INSERT INTO `course` (`course_ID`, `dept_ID`, `course_Name`, `course_Desc`, `Type`, `course_Credit`, `ACTIVE`) VALUES
('AN1101', 'AN', 'General Anthropology', 'This course is an introduction to the discipline of anthropology as a whole. It presents students with a theoretical grounding in the four major subfields: archaeology, biological anthropology, cultural anthropology, and linguistics. In this class the emphasis is on the holistic nature of the discipline. Students will be challenged with some of the countless links between the systems of biology and culture. They will explore key questions about human diversity in the past, present, and future.', 'Undergraduate', 4, 1),
('AN1111', 'AN', 'Cultural Anthropology', 'This course is an introduction to socio-cultural anthropology.  Socio-cultural anthropology offers a way of understanding both the commonalities of the human experience and the diversity of human societies and cultures. It offers tools for making sense of the experience of people whose lives are different from our own, as well as casting our familiar world in a new perspective.  Through readings, lectures, discussions, and films, students will become familiar with the concerns and viewpoints of cultural anthropologists. ', 'Undergraduate', 4, 1),
('AN1112', 'AN', 'Archaeology and Human Origins', 'The study of human origins is an interdisciplinary endeavor that involves a synthesis of research from a number of different areas of natural science, including genetics, evolutionary theory, geology, comparative anatomy, paleontology, primate behavior, ecology, forensic anthropology, and archaeology.  The aim of this course is to introduce students to the various approaches and methods used by scientists to investigate the origins and evolutionary history of our own species.  Class work will be problem-oriented, focusing on critically reviewing the different kinds of information and techniques that are currently available.  Laboratories emphasize hands-on activities through experiments and demonstrations, computer simulations and media, and working with skeletal materials and fossil casts', 'Undergraduate', 4, 1),
('AN1115', 'AN', 'Biological Anthropology', 'This course will use data from evolutionary theory, primatology, comparative anatomy, genetics, and paleontology to understand the latest hypotheses regarding human evolution and modern human behavioral biology.', 'Undergraduate', 4, 1),
('AN1194', 'AN', 'Topics Course', 'Varies by semester. Consult the department or class schedule for current listing.', 'Undergraduate', 4, 1),
('AN2206', 'AN', 'Endangered and Minority Languages', 'In this course, we will examine the historical, political, and socio-economic factors behind the endangerment and/or marginalization of languages in Africa, Asia, Australia, Europe, and North and South America. We will also concentrate on the globalization of English (and other major languages), which plays a primary role in language endangerment and marginalization. Additional topics include: linguistic diversity, language policy, multilingualism (in both nations and individuals), global language conflict, and language revitalization.', 'Undergraduate', 4, 1),
('AN2223', 'AN', 'Introduction to Archaeology', 'This course will introduce students to archaeology, the science of understanding cultures of the past through material remains. Students will learn the basic methodology and theory or archaeological research, and apply these in a hands-on activity.', 'Undergraduate', 4, 1),
('AN2230', 'AN', 'Ethnographic Interviewing', 'These interviews are conducted in order to study -through direct observation- the behavior, interests, lifestyle and attitudes of a specific target of interest for the company/brand. External intervention through these techniques is minimal, since the aim is precisely not to lose the spontaneity of the user or consumer being studied.', 'Undergraduate', 4, 1),
('AN2232', 'AN', 'Field Methods and Research Design', 'This course combines civic engagement with the fundamentals of ethnographic research needed for successful completion of a one to two-month field-based project. Learning modules will include: a) the ethics of social science research and human subjects review; b) research design and proposal; c) observation methods and field notes; d) interview methods and transcription; and e) qualitative data analysis.', 'Undergraduate', 4, 1),
('AN2239', 'AN', 'Medical Anthropology', 'Medical anthropology is a broad and vibrant discipline that draws on the four traditional subfields of anthropology—cultural, biological, linguistic, and archaeology—to examine the biocultural basis of health and to understand the cultural dimensions of illness experience and treatment. This seminar examines the major theoretical frameworks and key areas of empirical research in contemporary medical anthropology.', 'Undergraduate', 4, 1),
('AN2240', 'AN', 'Human Osteology and Paleopathology', 'Intensive introduction to human osteology, bone biology and growth, and paleopathology. Basis for advanced work in paleoanthropology, forensic anthropology, bioarchaeology, and osteometry', 'Undergraduate', 4, 1),
('AN2241', 'AN', 'Anthropology of Death and Dying', 'This course examines the dying process and the ways humans around the world come to terms with their mortality. We will critically analyze controversial issues regarding brain death, suicide, euthanasia, and organ donation.', 'Undergraduate', 4, 1),
('AN2243', 'AN', 'Psychological Anthropology', 'This course explores conceptions of subject, self and selfhood comparatively in anthropology, popular culture and psychoanalysis. The course may examine questions such as, How is a self formed? Under what conditions can a self change? What is the self’s relationship to the person, the digital and the virtual?', 'Undergraduate', 4, 1),
('AN2246', 'AN', 'Refugees/Humanitarian Response', 'The course explores the ethical and professional principles that guide humanitarian response to conflict and disaster. Participants will learn the legal and historical frameworks that shaped these principles, test their applicability to the challenges faced by humanitarian actors today.', 'Undergraduate', 4, 1),
('AN2251', 'AN', 'Politics of Memory in Latin America', 'In this course, we will analyze how narratives and practices of memory intersect and give shape to various political and social landscapes in contemporary Latin America. We will critically engage with the different theoretical approached developed around the concept of memory both inside and outside Latin America, as we discuss the particularities of individual, collective, national, and global memories.', 'Undergraduate', 4, 1),
('AN2252', 'AN', 'Photography: Theories and Practices of an International Medium', 'This course examines histories, theories and practices of photography, a medium that has transformed significantly since the daguerrotypes of the mid 19th century.', 'Undergraduate', 4, 1),
('AN2253', 'AN', 'Comparative Muslim Cultures', 'This course examines the Quran and hadith, and other authoritative texts that ground Islamic jurisprudence, and explores the diverse ways in which Muslims have understood and interpreted these teachings in locations across the world (i.e. Indonesia, the Middle East, South Asia, Europe and the United States) and at various points in history.', 'Undergraduate', 4, 1),
('AN2255', 'AN', 'Latin America in Motion', 'This course is an introduction to the cultural diversity and complexity of Latin American societies. We will examine regional differences from an anthropological perspective and discus how social institutions and cultural practices and traditions have been shaped, and how they have dealt with continuity and change. Ethnographic case studies will allow us to explore relevant topics related to ethnicity, social stratification, gift-giving/reciprocity, kinship, rural/urban relationships, cosmology and religion, and gender. These issues will be examined within the context of particular histories, considering the legacy of colonialism, the formation of the nation-state, the emergence of social movements, post-colonial nationalism, the impact of migration and urbanization, and the effects of neo-liberalism and globalization.', 'Undergraduate', 4, 1),
('AN2256', 'AN', 'India and its Neighbors: The Anthropology of South Asia', 'Introduces students to anthropological knowledge of the peoples and cultures of South Asia and to the ways in which Western knowledge of that region has been constructed. The course examines the historical and social processes that have shaped the culture and lifeways of the people who live on the subcontinent and that link the modern states of South Asia to the world beyond their frontiers.', 'Undergraduate', 4, 1),
('AN2258', 'AN', 'Dynamic Africa', 'Africa has long been a continent on the move. This course introduces students to concepts associated with systems, process, and change in Africa by juxtaposing classic and contemporary ethnography that aims to get at how lives, subjectivities, and intimacies on the continent mediate and are shaped by global historical processes and how anthropologists have inhabited and tried to grasp such contexts. Toward this end, we draw on diverse representations of Africa that include fiction, film, and more traditional forms of scholarship.', 'Undergraduate', 4, 1),
('AN2259', 'AN', 'Indigenous Peoples of the Arctic', 'The Arctic represents one of the most extreme environments to which humans have adapted. These adaptations include both biological and cultural changes required to settle and flourish in this formidable setting. This course looks at some of the cultural practices that appear to be ubiquitous throughout the Arctic, as well as those specializations that have developed as a result of some of the more localized environmental pressures. It also explores the consequences of rapid global climate change as well as modernization on these unique cultures to get a sense of what the future might hold for the indigenous peoples of the Arctic.', 'Undergraduate', 4, 1),
('AN2270', 'AN', 'Cultural Resource Management', 'This course explores the role of public archaeology in the United States through an examination of the laws and practices dictating the protection of historic properties, consultation with descendant communities, and the design of archaeological management plans.', 'Undergraduate', 4, 1),
('AN2294', 'AN', 'Topics Course', 'Varies by semester. Consult the department or class schedule for current listing.', 'Undergraduate', 4, 1),
('AN3333', 'AN', 'The Language of Diplomacy', 'This interdisciplinary course, co-taught by faculty in Anthropology and French and Francophone Studies, will introduce students to the broad range of international institutions where French is one of the primary working languages. Language, as the basis for human cooperation, provides a vehicle for students to explore the connections between language, power, and human rights. To engage students from the outset with the lived experiences of those working in the larger diplomatic world, students will do a life-history interview with a professional to learn more about their career trajectory and the work that they do. We will further bring real-life scenarios into the classroom by watching and analyzing simulcast sessions in French from the International Criminal Court and the United Nations High Commissioner for Refugees. Throughout the course we will deepen our understanding of the historical and cultural dynamics within Europe over the past 150 years that gave rise to, maintain, and subvert the role of language in diplomacy', 'Undergraduate', 4, 1),
('AN3335', 'AN', 'Global Generosity', 'From Italian Mafia dons to famous American philanthropists; from the knitting of \"trauma teddies\" in Helsinki to gift shopping in London; and from ceremonial exchange rings in Melanesia to the present day global refugee crisis: this course will investigate how generosity is understood and practiced in global perspective. Well begin the semester by examining key debates surrounding reciprocity, gifts, and exchange, theories of altruism and generosity, and patron-client relations. Well then explore the birth of the \"humanitarian spirit,\" and the complicated ethics and politics of humanitarian intervention. We will compare diverse religious traditions approaches to giving, including Islam, Christianity, Hinduism, and Jainism. And well explore contemporary debates surrounding volunteerism within sectarian and neoliberal political regimes', 'Undergraduate', 4, 1),
('AN3368', 'AN', 'Life Histories/Cultures/Selves', 'This seminar focuses on the relationship between individuals and their culture. Students will record, edit, and analyze personal documents such as diaries, letters, interview transcriptions, and autobiographies. Analysis of life events such as childhood play activities, family meals, kinship relations, and modes of communication, will lead to the identification of cultural themes.', 'Undergraduate', 4, 1),
('AN3369', 'AN', 'Food and Culture', 'This course is an introduction to the anthropology of food, focusing on how food creates community and shapes identity, class and gender. The course also covers the transition from foraging to agriculture, the role of particular foods in the making of the modern world, and the nature of the modern industrial food system.', 'Undergraduate', 4, 1),
('AN3380', 'AN', 'Stigma and Disabilities', 'This course provides an in-depth focus on a major topic in medical anthropology as it pertains to human health, illness, and/or healing. Specific topics vary from year to year, ranging from traditional healing systems, to health related stigma and social inequalities. Students will learn to apply social theories to important health issues, and will critically read, analyze, and discuss the clinical, epidemiological, and social science literature pertaining to the most recent discussions and debates about the topic.', 'Undergraduate', 4, 1),
('AN3381', 'AN', 'Emerging Infectious Diseases', 'This course examines the human determinants of infectious diseases from the Paleolithic to the present day using the combined frameworks of evolution, human ecology, critical history, and social epidemiology. We will consider the co-evolution of culture and disease: the ways that human subsistence, ecological disruptions, social inequalities, and demographic changes have created selective conditions for new infections, re-emerging infections, and antibiotic resistance. We will also address the social dynamics of current epidemics, and major controversies over biosecurity and bioterrorism', 'Undergraduate', 4, 1),
('AN3387', 'AN', 'Darwin and Evolutionary Thought', 'This course examines the influence of Charles Darwin on both the discipline of Anthropology and general scientific thought in the 20th century. It begins with an exploration of the emergence of modern evolutionary theory, its role in society, and how it is essential to the field of Anthropology. We consider some of the work of Darwins predecessors, who laid the intellectual and scientific foundations that Darwin built upon, as well as those who adapted Darwins concepts to theories of social change. Students also read and discuss some of the biggest debates surrounding the theory of Evolution by Natural Selection, both past and present. Finally, we look at the future of evolutionary theory in light of recent developments in molecular biology and the fossil record.', 'Undergraduate', 4, 1),
('AS1152', 'AS', 'Themes in U.S. History', 'The course is an introduction to major issues in the history of the United States, from colonial times to the twentieth century. Topics may include: the origins of slavery and racism; industrialization and the growth of cities and suburbs; the growth of the American empire; movements for social change.', 'Undergraduate', 4, 1),
('AS1282', 'AS', 'Introduction to African American Studies', 'This is an introductory course in the themes and issues relevant to the inter-disciplinary feld of African-American studies. Topics include: the origins and development of slavery and racism; African-American contributions to U.S. history; major African-American writers, artists, and thinkers; movements for political, racial, and economic equality.', 'Undergraduate', 4, 1),
('AS1512', 'AS', 'Introduction to Women’s Studies', 'Explores the development of women’s lives, from childhood through adolescence to maturity. Focuses on the family, school, sexuality, and career options, and how these experiences and choices are affected by race, class, religion, ethnic origin, and gender. Readings include fction, autobiography, history, and social science.', 'Undergraduate', 4, 1),
('AS2112', 'AS', 'American People l', 'History of the American people to 1877, which emphasizes the diverse experiences and perspectives of women, people of color, working people, and other historically marginalized groups. Topics include the American Revolution and the Constitution, the origins and development of slavery, the development of Northern capitalism, territorial expansion and displacement of Native Americans, and the conficts which led to the Civil War. Novels and flms supplement more traditional texts.', 'Undergraduate', 4, 1),
('AS2122', 'AS', 'American People lI', 'History of the American people, 1865 to present, which emphasizes the diverse experiences and perspectives of women, people of color, working people, and other historically marginalized groups. Topics include Reconstruction, the Industrial Revolution and the growth of the corporation, the creation of the working class, World Wars and American expansion, Progressivism, the Depression and the New Deal, the rise of industrial unionism, the Cold War, and the Civil Rights movement and new challenges emerging with the rise of global capitalism. Novels and flms supplement more traditional texts.', 'Undergraduate', 4, 1),
('AS2202', 'AS', 'Contemporary U.S. Society', 'An introduction to social, economic and political stratifcation in the United States. Sources and consequences of inequality are explored through an examination of educational, political, and occupational structures.', 'Undergraduate', 4, 1),
('AS2252', 'AS', 'US Social Movements', 'This course explores the causal conditions, nature, and impact of progressive social movements in America. Varying sets of activist biographies and social movement histories related either by period or theme will be selected for study. Possible topics include the abolition, temperance, feminist, peace, labor, civil rights, reproductive rights, and environmental movements.', 'Undergraduate', 4, 1),
('AS2262', 'AS', 'African American History I', 'This course examines the experiences of African Americans in the development of America from the Trans-Atlantic slave trade through the Civil War. Topics include plantation slavery, politics, economics, cultural production, gender and intellectual pursuits. Emphasis on major movements and fgures as well as ordinary individuals.', 'Undergraduate', 4, 1),
('AS2263', 'AS', 'African American History II', 'This course examines the experiences of African Americans in the development of America from 1865 through the twentieth century. Topics include Reconstruction, segregation, migrations, war, cultural production, entrepreneurship and the push for civil rights. Emphasis on social and cultural history across class and gender lines.', 'Undergraduate', 4, 1),
('AS2300', 'AS', 'Problems in US Environmental History', 'This course examines the history of Americans’ interactions with the physical environment of the current United States from the European colonial period to the present. Through assigned readings, class discussions, short flms, short writing assignments, and speakers, we will consider 500 years of human occupation of North America and its environmental consequences. We will examine how natural environments have established parameters for human economic and social activity, as well as how human beings have interpreted and then reshaped their environmental surroundings in an effort to satisfy their perceived needs. In addition, we will study how different groups of Americans have interacted in their quest to manage, control and distribute the resources of the land, and the impact of “race” and gender on perceptions of our place in and relationship to the non-human environment.', 'Undergraduate', 4, 1),
('AS2640', 'AS', 'US Latina/o History', 'This course will study the long history of Latina/os in the United States from the colonial era to the present, as well as explore important issues in Latina/o culture and politics. We will look in detail at the history of Mexican and Puerto Rican communities in the United States, and we will pay close attention to the impact of nationality, class, and gender in shaping Latina/o lives. This course will highlight the role of imperialism, racism, and nativism in structuring Latina/o opportunities in the United States, and will emphasize the social movements that Latinas/os have forged to resist such forces.', 'Undergraduate', 4, 1),
('AS2652', 'AS', 'Media Studies', 'How can we comprehend and critique the media that immerse us? Let’s examine the media in the context of the political and social economies within which they were developed. Drawing on a broad range of cultural theories, this course addresses the functioning of media in a diverse and globalizing environment. A range of media is studied through scholarship and primary texts: art, movies, advertisements, interviews, novels, short stories, and photographs.', 'Undergraduate', 4, 1),
('AS2700', 'AS', 'The Engaged Eye', 'In this introductory course students are introduced to efforts by artists and reformers who use the camera, the paint brush, or other media for social change and social justice. The approach will be biographical and historical. Students will learn about the work of photographers such as Jacob Riis, Lewis Hine, and Dorothea Lange, or artists such as John Sloan, Ben Shahn, Alice Neel or Kara Walker, along with more contemporary photographers by placing their photographic or artistic projects within the context of the artist’s life and times.', 'Undergraduate', 4, 1),
('AS2750', 'AS', 'Food', 'The production, consumption, and meanings of food are social, cultural and political. This course introduces students to prominent contemporary thinkers about food. Food is an interdisciplinary course drawing from history, environmental studies, documentary studies, sociology, anthropology, folklore, economics, critical race studies, and other felds. It will explore how food is understood, food and meal rituals, how food is produced, distributed, and consumed, with a focus on eating habits and the environment. The course will also introduce students to selected debates and initiatives around food: from diets such as vegetarianism, veganism, and locavorism; food and climate; the industrialization of food, the use of GMOs, food deserts, food insecurity, racial and gender injustice within the food justice movement, obesity and sizeism, and more.', 'Undergraduate', 4, 1),
('AS2802', 'AS', 'Multimedia Journalism', 'Explores the historical and contemporary role of journalism and media in society, while also introducing students to basic media production concepts. This course serves as an introductory survey for any student interested in media literacy for self-expression and civic participation and as a foundation course for media majors. Units in print, audio, moving image and emerging media focus on writing and reporting, creative presentation, ethics and professional best practices. May include visits to campus media facilities.', 'Undergraduate', 4, 1),
('AS3222', 'AS', 'Urban History', 'This course investigates urban history in the United States with a focus on the 20th century and on the role of race and ethnicity in shaping urban America. Using an array of scholarly texts, media, and primary source documents, this course will trace the social, economic, and cultural history of U.S. cities and the growth of their suburbs. Topics will include: the formation of early-twentieth century immigrant/ethnic communities and the advent of neighborhood segregation; the Great Migrations of African Americans to the urban North; white fight, suburbanization, and urban economic decline after WW II; urban “crisis” and radical anti-racism in the 1960s and 70s; gentrifcation, mass incarceration, and the rise of “Global Cities” toward the end of the century.', 'Undergraduate', 4, 1),
('AS3270', 'AS', 'Africa in the Americas', 'This course will explore the history of these scattered populations of Africa, their dispersal to the various regions of the world, especially the Western hemisphere, the circumstances and institutions which shaped the evolution of these diaspora communities, and the continuing physical and emotional ties to Africa and Africans. The dispersal of black people from their homes in the continent of Africa to the diverse geographical sites all around the world is one of the more momentous, historical and sociological events in the trajectory of world history.', 'Undergraduate', 4, 1),
('AS3412', 'AS', 'African-American Women’s History', 'This course focuses on the distinct experiences of African-American women in the 19th and 20th centuries. The course includes the experiences of women in slavery, social movements, abolition, anti-lynching, suffrage, civil rights, and Black Power as well as the writings and lives of the major fgures.', 'Undergraduate', 4, 1),
('AS3432', 'AS', 'Women: Cultural Issues', 'An interdisciplinary course that looks at the lives of women across the world. Readings and materials focus on the variety of circumstances in which women live, the factors that directly infuence their situation, the interaction between cultural constraints and existential possibilities, and women’s efforts to change and improve their own and others’ lives. In this course students also examine how women in multiple contexts utilize mass culture and develop new cultural forms to advance their interests.', 'Undergraduate', 4, 1),
('AS3462', 'AS', 'History of Women in the U.S.', 'This course surveys women’s experience from 1620 to the present. The course analyzes women’s connection to key aspects of American history such as the American Revolution, slavery and the 20th century development of the welfare state. This course posits women as agents of change in American history, but the course also examines how the study of women over time raises questions about traditional chronologies of American history. Students will be introduced to well-known and little known women and their individual and collective attempts to reshape American society through examination of diaries, autobiographies, fction, government hearings and flm.', 'Undergraduate', 4, 1),
('AS3622', 'AS', 'Sports and Society', 'Explore the prominent place of sports in the United States and other societies. What is the relationship of sports to larger questions of identity, politics, economics, and history? The course illuminates how class, race, gender, sexuality, and nation interplay in our understanding of sports and culture.', 'Undergraduate', 4, 1),
('AS3632', 'AS', 'History of U.S. Film', 'A history of flm in the United States from the 1890’s to the present. It examines the social, political, economic, and cultural changes of different eras in relation to the emergence and popularization of modern cinema. Students must see and comment on all the flms shown in the course.', 'Undergraduate', 4, 1),
('AS3712', 'AS', 'American Film Genres', 'An in-depth examination of classic genres of flms in the United States. Genres studied may include silent comedy, the Western, the melodrama, the gangster flm, science fction, horror, and musical comedy. The course investigates the connection between genre forms and the development of Hollywood mythology and U.S. ideology.', 'Undergraduate', 4, 1),
('AS3722', 'AS', 'History of Mass Media', 'Learn the history of the mass media. We will examine the parts played by government, private enterprise, social movements, and technology in the development of the major. In addition to the political economy of the media, the course will cover the conficts over civil liberties, mass culture, advertising, and the rise of consumer culture in America.', 'Undergraduate', 4, 1),
('AS3732', 'AS', 'Politics of Media', 'Using a broad defnition of politics –not only the world of elections or of governance, but of power relations in everyday life—this course examines how political structures affect the mass media, and how the mass media are a strong infuence in politics. The ways in which the media promotes democracy and citizenship, but also constricts democracy, are central to the course. The branding of culture, corporate consolidation, and the images of women and minorities in the media are all examined, as are various forms of the media including flm, the Internet, and television.', 'Undergraduate', 4, 1),
('AS3735', 'AS', 'Documentary Media Studies', 'What is reality? Can truth be captured and represented? Learn about documentary flm, photography and new media projects from the birth of photography to today. Watch and critique seminal documentary projects. Explore documentary as political expression, entertainment, art, journalism, propaganda and self-portrait. Lectures, readings and discussions focus on forms and styles of non-fction storytelling, the role of documentaries in society, and documentary ethics and practice.', 'Undergraduate', 4, 1),
('AS3742', 'AS', 'Myths and Images in Film', 'United States, Europe, Latin America and Africa. It explores flm form as well as content and their relationship to each other.', 'Undergraduate', 4, 1),
('AS3745', 'AS', 'Film and Gender', 'This course examines the social, historical, and technological construction of flm as a medium as well as the social and technological construction of gender. By looking at contemporary American flms, students will refect upon and critique the various representations of gender conformity and fuidity. The intent of the class is to both expand an understanding of gender and to identify the ways in which flm reinforces binary notions of gender and gender roles.', 'Undergraduate', 4, 1),
('AS3810', 'AS', 'Music and Media', 'A history of American popular music: Follow changes in American musical culture from work songs and parlor pianos to auto-tune and streaming media. This course will cover the cultures, politics, and economics of music-making and proft-taking in the history of popular music, the music business, and the media in the U.S.', 'Undergraduate', 4, 1),
('AS3830', 'AS', 'Public Relations and Society', 'The course examines the role of public relations in the media, corporate culture, politics and society. This is an intermediate-level course that is designed for students who previously have not taken formal instruction in public relations. Students receive instruction in the basics of public relations and perform exercises intended to equip them with a working knowledge of the feld.', 'Undergraduate', 4, 1),
('BS2400', 'BS', 'Basic Biology I with Lab', 'Lecture/Laboratory frst semester of freshman biology courses covering content areas including molecular and cellular biology, genetics, genomics and evolution. These courses are offered every semester.', 'Undergraduate', 4, 1),
('BS2410', 'BS', 'Basic Biology II with Lab', 'Lecture/Laboratory second semester of freshman biology courses covering content areas including cell metabolism, comparative animal and plant anatomy and physiology and ecology. These courses are offered every semester', 'Undergraduate', 4, 1),
('BS3400', 'BS', 'Vertebrate Physiology', 'A regulatory systems approach to the principles of animal physiology, developed through consideration of functioning of cells, tissues, and organ systems with an emphasis on humans. (With 3-hour laboratory) Offered every semester.', 'Undergraduate', 4, 1),
('BS3450', 'BS', 'Plant Biology', 'The study of plants as biological organisms. Topics include classifcation and evolution of the plant kingdom: plant anatomy, physiology and reproduction, with emphasis on the fowering plants. Consideration given to experimental methods used in studying plants and the importance of plants and plant studies. Students are expected to complete an experimental project or observational study. Lecture, discussion, laboratory and feld trips, or audio tutorial integration of these are presented. Offered every year.', 'Undergraduate', 4, 1),
('BS3500', 'BS', 'Invertebrate Zoology', 'This course will explore the diversity of invertebrate types, morphologically, embryologically, and physiologically. The ecological role of invertebrates will be emphasized', 'Undergraduate', 4, 1),
('BS3510', 'BS', 'Parasitology', 'Lecture/laboratory course. Major parasites of medical and economic interest are examined, including the causal agents of malaria, trypanosomiasis schistosomiasis, and flariasis. The ecology, anatomy, pathology, and public health importance of these parasites are emphasized. Laboratories include both live and prepared material.', 'Undergraduate', 4, 1),
('BS3520', 'BS', 'Comparative Anatomy', 'Lecture/laboratory course designed for biology majors and premedical students. Emphasis is on the basic anatomical patterns of vertebrate structure. Morphogenesis and structure function relationships are discussed in terms of adaptive signifcance. Laboratory includes dissections of aquatic and terrestrial vertebrates. Offered every other semester.', 'Undergraduate', 4, 1),
('BS3530', 'BS', 'Comparative Genomics Lect. and', 'Lecture course. Explore the interdisciplinary feld of genome science. Study the genomic similarities and differences between organisms, how the genome is constructed and operates, and how genomes evolved. Understand the advances in genomic technologies and their applications in health care.', 'Undergraduate', 4, 1),
('BS3531', 'BS', 'Comparative Genomics Lab', 'Lab sections will explore the latest sequencing technologies and tools to analyze genomic data.Offered every other semester.', 'Undergraduate', 4, 1),
('BS3710', 'BS', 'Environmental Physiology', 'Lecture/workshop course designed for science students. Examines the aging process on the molecular, cellular, and organismic levels. Emphasizes alterations during the aging process in cells whose life span is identical to that 166 of the entire organism. Examination of various pathological disorders in relationship to aging is also emphasized. Students are required to read original articles and be prepared to discuss current topics in workshop settings. Offered every other year.', 'Undergraduate', 4, 1),
('BS3810', 'BS', 'Biological Aspects of Aging', 'Lecture/workshop course designed for science students. Examines the aging process on the molecular, cellular, and organismic levels. Emphasizes alterations during the aging process in cells whose life span is identical to that 166 of the entire organism. Examination of various pathological disorders in relationship to aging is also emphasized. Students are required to read original articles and be prepared to discuss current topics in workshop settings. Offered every other year.', 'Undergraduate', 4, 1),
('BS4400', 'BS', 'Cell Biology', 'Lecture/discussion/laboratory course whose content is directed to the study of the molecular basis of cell activities, cell ultra structure, and its integration with cellular function. Lectures survey the cell in its environment, energy transformation, mobility, replication of genetic material, growth, nucleocytoplasmic interactions. The laboratory explores techniques used in the study of the cell. Offered every other semester.', 'Undergraduate', 4, 1),
('BS4410', 'BS', 'Histology', 'A laboratory-oriented course dealing with the microscopic and ultramicroscopic anatomy of mammalian tissues and organs with emphasis on relating structure to function. Offered on demand.', 'Undergraduate', 4, 1),
('BS4411', 'BS', 'Seminar I: Reading in the Discipline', 'Designed to increase ability to read in the discipline. Students will survey scientifc literature, learn how to research topics, prepare abstracts, etc. Students will select a mentor and topic for Seminar II. Must be taken by students two semesters prior to graduation. Offered every Fall and Spring. Pr', 'Undergraduate', 4, 1),
('BS4420', 'BS', 'Seminar II: Writing in the Discipline', 'Designed to promote an in-depth consideration of special topics in current biological research. The course will include presentations by both external speakers and students. The student will, under the advisement of a faculty mentor, develop a topic either as a library or laboratory study and present the results both orally and as a written paper. Offered every Fall and Spring.', 'Undergraduate', 4, 1),
('BS4421', 'BS', 'Microbiology', 'Lecture/laboratory course concerned with structure-function relationships in various types of microorganisms, with particular emphasis on bacteria. Nutrition, biosynthesis, energetics, growth, microbial interactions and symbiotic relationships, host-parasite relationships, and microbial genetics are among the topics discussed. Offered every semester.', 'Undergraduate', 4, 1),
('BS4440', 'BS', 'Evolution', 'Lecture/discussion course presenting the history of life on earth from its inception to the emergence and early history of Homo sapiens. Through readings, lectures, demonstrations, laboratories, discussions, and museum trips, students examine modern evolutionary theory and concepts, including abiogenesis, adaptation, population genetics, race, speciation, and progressive evolution. Offered every other semester.', 'Undergraduate', 4, 1),
('BS4460', 'BS', 'Genetics', 'Lecture/laboratory course presenting the fundamental principles of genetics, the molecular biology of the gene, and heredity in humans. Through lectures, readings, laboratories, and discussions, students examine the experimental evidence leading to currently accepted concepts, and critically analyze the implications of various fndings in human genetics. Offered every other semester.', 'Undergraduate', 4, 1),
('BS4461', 'BS', 'Immunology', 'This course will introduce students to the essential concepts of how the immune system works, what are the molecular and cellular mechanisms and pathways involved in the defense of an organism from infectious diseases or cancer, and it will describe in detail the cells and molecules of the mammalian immune system. The laboratory component is a research-based course where students participate in the development of new knowledge by generating a novel research question and performing their own experimental design. Offered every other semester.', 'Undergraduate', 4, 1),
('BS4470', 'BS', 'Ecology', 'A general ecology course focused on the study of ecosystems. It fulflls the population content area course requirement for the BA and BS degrees in Biology. The course includes a lecture (3 hours/week) and a laboratory component (3 hours/week). Topics include ecosystem structure and function, population dynamics, community structure, food webs, energy fow, nutrient cycles, biogeography, associations, succession, adaptation and niche analysis, and interspecifc interactions. The course is taught in a blended format with a signifcant online course 167 component. The laboratory component includes extensive feld work. Students working in groups must design and implement a research project involving data collection from a campus ecosystem. The project culminates in a group oral presentation. Students are also encouraged to present their results at a local or regional conference and/or submit their results for publication to a peer-reviewed undergraduate research journal', 'Undergraduate', 4, 1),
('BS4473', 'BS', 'Tropical Marine Biology', 'Integrates ecological and physiological concepts in order to show how anthropogenic stressors such as increased temperature, pollution, and ocean acidification can impact the resilience of tropical marine ecosystems.', 'Undergraduate', 4, 1),
('BS4474', 'BS', 'Microbial Ecology', 'Lecture/laboratory course This course is designed to introduce students to the study of microbial ecosystems its structure and function using an inquiry based approach that models the scientifc research process. It fulflls the population content area course requirement for the BA and BS degrees in Biology. The course includes a lecture (3 hours/week) and a laboratory component (3 hours week). The course is taught in a blended format with a signifcant online course component. In the lecture component, students will be introduced to ecological theory in the context of the laboratory experimentation. As part of their investigation the students will learn about ecosystem structure, i.e. biotic and abiotic components, and function, i.e. symbiotic interactions and food webs. As part of the biotic component of the ecosystem, the students will focus on the study of a microbiome using both traditional microbiology, i.e. microscopy, isolation using generalized and selective media, and molecular techniques, next generation sequencing methodology, and bioinformatics tools for the analysis of microbiomes: DNA isolation from environmental samples, PCR amplifcation using specifc primers, i.e. 16S rDNA, and sequence analysis using Qiime2 and R', 'Undergraduate', 4, 1),
('BS4480', 'BS', 'Animal Behavior', 'A lecture/laboratory course introducing the feld of animal behavior. Lectures, discussions and flms explore topics including the cultural basis of behavior, the organization and physiology of the nervous system and its role in controlling behavior, the endocrine basis of behavior, genetic basis of behavior and sociobiology.', 'Undergraduate', 4, 1),
('BS4491', 'BS', 'Human Ecology', 'Students will examine the adaptation of human populations to their environment. Topics include: biological and cultural evolution, human diversity, impact of limiting resources, the ecology of disease, and urban ecology and planning. This course is offered once a year', 'Undergraduate', 4, 1),
('BS4500', 'BS', 'Cell and Molecular Neurobiology', 'Lecture course designed to familiarize students with intracellular communication mechanisms and how they are used to promote intercellular interactions. Includes concepts as they relate to neurobiology; ephatic and synaptic transmission; neurophysiology/neuropharmacology; selected topics relating to mental health, narcotic addiction etc. Offered every other year.', 'Undergraduate', 4, 1),
('BS4550', 'BS', 'Cancer Cell Biology', 'Lecture/Discussion. The study of cancer disease requires knowledge of several essential biological processes that govern the basic of the living system. This course will explore the cellular and molecular mechanisms underlying cancer development with the aim of understanding how changes in the normal cell growth and division processes lead to the formation of tumors. Case studies will be used to explore the roles of specifc mutations in cancer develop- ment and the pathways they affect, as well as the classes of genes targeted during cancer development. This upper level course builds on concepts introduced in courses in Cell Biology and Genetics and will emphasize experimental methods and design as well as critical data analysis. Students will discuss papers from the primary literature each week individually or in groups. Offered every other semester.', 'Undergraduate', 4, 1),
('BS4560', 'BS', 'Molecular Biology', 'Lecture/Laboratory course to introduce students to both the theoretical and practical aspects of molecular biology. An understanding of molecular biology necessitates a synthesis of information from genetics, biochemistry, cell biology, physics and chemistry. The course will include microbial studies, cellular components, genes, regulation etc. The lab component will utilize techniques of genetic engineering. Offered every other year.', 'Undergraduate', 4, 1),
('BS4590', 'BS', 'Advanced Research', 'Research project carried out under the supervision of a faculty member. Each project includes a survey of the appropriate original literature and investigation of a selected research topic by experimental or theoretical methods. Open to students of upper-division standing, preferably seniors, on acceptance as a research student by a faculty member. Students may take this course twice for credit but may receive only 4 credits from this course toward the major. Grading will be CR/NC. Offered every semester.', 'Undergraduate', 4, 1),
('BS4591', 'BS', 'Environmental Research ', 'Research project in environmental science carried out under supervision of a faculty member. Open to upper-division students, preferably seniors on acceptance as a research student by a faculty member. Offered every semester.', 'Undergraduate', 4, 1),
('BS4651', 'BS', 'Toxicology', 'The primary goal of the Toxicology course is to develop an understanding of how the bodys biochemical and physiological mechanisms operate to manage the exposure to toxins, poisons and drugs.', 'Undergraduate', 4, 1),
('BU2300', 'BU', 'Business & Economics (GE)', 'Limits, differentiation, and integration. Relevant applications from the areas of business, economics and the social sciences. Offered every semester.', 'Undergraduate', 4, 1),
('BU2420', 'BU', 'Principles of Microeconomics (GE)', 'An introduction to neoclassical economic theory. Consumer and producer behaviors, price formation in the market and the role of the market in allocating resources and coordinating social production are among the topics covered. Offered every semester.', 'Undergraduate', 4, 1),
('BU2430', 'BU', 'Principles of Macroeconomics', 'An introduction to conventional macroeconomic theory, including the determination of national income, government taxing and spending policy, money and banking, unemployment, and infation. Offered every semester.', 'Undergraduate', 4, 1),
('BU3010', 'BU', 'Information Systems for Managers', 'Introduction to the concept of information systems as strategic assets of the enterprise utilized to achieve strategic advantage. Investigation is also made of the use of information systems at the tactical and support business levels. Technology is always discussed in terms of its interaction with human systems (socio-technical systems). The goals are to facilitate management decision processes and to exploit information technology for strategic advantage. Offered every semester.', 'Undergraduate', 4, 1),
('BU3071', 'BU', 'Information Technology & Application', 'The purpose of this course is to provide the student with the requisite skills needed to complete technology-based assignments in accounting and business courses, obtain the necessary skills expected of entry-level accountants and fnancial managers (0-2 years) and help prepare students for technology-related subjects tested in professional certifcation exams (e.g., CPA, CMA, and CIA). Offered every semester', 'Undergraduate', 4, 1),
('BU3502', 'BU', 'Accounting I', 'Building on the knowledge gained in principles of accounting I', 'Undergraduate', 4, 1),
('BU3511', 'BU', 'Accounting II', 'Going over the different principles of business law', 'Undergraduate', 4, 1),
('BU3600', 'BU', 'Principles Business Law', 'Diving deeper into the intricaces that make up business law', 'Undergraduate', 4, 1),
('BU3605', 'BU', 'Intermediate Business Law', 'An in-depth study of the law of contracts, agency, and partnerships. Offered every semester. P', 'Undergraduate', 4, 1),
('BU3610', 'BU', 'Advanced Business Law', 'The study of real and personal property, bailment, documents of title, bankruptcy, secured transactions, and trusts and estates. Offered every semester.', 'Undergraduate', 4, 1),
('BU3800', 'BU', 'Marketing: Principles & Concepts', 'A comprehensive introduction to marketing principles with emphasis on the marketing concept as means of distributing goods and services in a competitive economy. Examines market determination and population segmentation for product planning, product distribution systems, pricing policies and practices, and promotion strategies. Offered every semester.', 'Undergraduate', 4, 1),
('BU3905', 'BU', 'Business Communication', 'This course is an introduction to the fundamentals of business communications. It emphasizes planning, research, organization, clarity, conciseness, positive tone, mechanics and format. Business letters, electronic communications, memos, and reports will be written and analyzed. Replaces BU3900. Offered every semester.', 'Undergraduate', 4, 1),
('BU4035', 'BU', 'Web Systems & Electronic Commerce', 'This course covers the basics of web systems, furthering an understanding of them through the development of e-commerce applications and systems. The course provides an overview of several current web technologies, including client side applications such as web design using JavaScript and VBScript and server side applications on Apache (Linux) and IIS (Windows) using CGI, ASP, and Java Servlet technologies. Students will implement an e-commerce application using the learned components involved in a web system and e-business strategies. Projects are carried out individually and in groups. Offered every year.', 'Undergraduate', 4, 1),
('BU4110', 'BU', 'Organizational Behavior & Management', 'This course examines the evolution of organizations and managerial roles in contemporary organizations. It provides a comprehensive analysis of the functions and processes of management. Topics include the infuence of business on society, international business, the managerial functions of planning, organizing, leading, and control, and the social infuence of management in terms of ethics, leadership, power, communication, confict, and organizational culture. Also studied are employee motivation, diversity, group dynamics, and decision-making. Offered every semester.', 'Undergraduate', 4, 1);
INSERT INTO `course` (`course_ID`, `dept_ID`, `course_Name`, `course_Desc`, `Type`, `course_Credit`, `ACTIVE`) VALUES
('BU4115', 'BU', 'Operations Management', 'Introduction to the theoretical and practical applications of OM. Topics: logistics; facility location layout; acquisition and replacement forecasting; planning; operation scheduling and control; inventory planning and quality control. Offered every semester.', 'Undergraduate', 4, 1),
('BU4120', 'BU', 'Global Business', 'Checking out the operations that is standard in management', 'Undergraduate', 4, 1),
('BU4125', 'BU', 'Business Ethics', 'This is a managerially oriented course dealing with the relationship between business and society. A variety of viewpoints will be presented in the examination of the following topics: social responsibility of business, quality of work life, ecology and environment, consumerism, business and government, and managerial ethics. Offered every semester.', 'Undergraduate', 4, 1),
('BU4130', 'BU', 'Entrepreneurship', 'Continuing the basics of accounting such as what programs are used to record data and how to properly summarize the transactions', 'Undergraduate', 4, 1),
('BU4171', 'BU', 'Human Resource Management', 'Examining the strategies and policies of business', 'Undergraduate', 4, 1),
('BU4190', 'BU', 'Business Strategy & Policy', 'Synthesizes the concepts and techniques developed in prior courses. The student is required to apply concepts from management, accounting, marketing, economics, and fnance using the casework and/or simulation approach. Offered every semester. Must be taken in student’s senior year.', 'Undergraduate', 4, 1),
('BU4195', 'BU', 'Management Seminar', 'Selected current issues in the feld are discussed. Emphasis will be on student research and critical analysis of topics. Topics may vary from year to year. Offered occasionally.', 'Undergraduate', 4, 1),
('BU4196', 'BU', 'Leadership', 'Explaining the essentials of the government', 'Undergraduate', 4, 1),
('BU4762', 'BU', 'Financial Management', 'This course provides an introduction to the basic ideas of fnance. The primary concepts covered include introductory accounting knowledge, time value of money, risk-return trade-off, the basic characteristics of fnancial markets and fnancial securities, cost of capital budgeting. Offered every semester.', 'Undergraduate', 4, 1),
('BU4774', 'BU', 'Financial Markets & Institutions', 'Researching the plans behind marketing', 'Undergraduate', 4, 1),
('BU4851', 'BU', 'Consumer Behavior', 'Incorporates concepts from the behavioral sciences that provide a foundation for the study of buyer behavior. The course evolves through an exploration of the contributions from economics, psychology, sociology and cultural anthropology that reveal the motivations underlying consumer behavior. Offered every semester', 'Undergraduate', 4, 1),
('BU4880', 'BU', 'Brand Theory & Strategy', 'This course focuses on how brands are created and managed within the marketing process. Using an interdisciplinary marketing and social science perspective, students analyze the cultural system of brand identity generated by product manipulation and consumer choice, creating value for both buyer and corporation. Marketing policies are evaluated through an analysis of product development, distribution and pricing with particular focus on the newest communication tools in advertising, public relations and sales promotions. Offered every semester.', 'Undergraduate', 4, 1),
('BU5505', 'BU', 'Essential of Government and Nonprofit Accounting', '', 'Graduate', 4, 1),
('BU5540', 'BU', 'Advanced Accounting ', 'Advanced Accounting is designed to prepare you to analyze, interpret, and use financial statements effectively, both from a general manager and from an investor perspective. The course will review and extend the topics introduced in Accounting and Financial Reporting, with an emphasis on value creation.', 'Graduate', 4, 1),
('BU5550', 'BU', 'Auditing ', 'In the simplest terms, auditing college courses is when a student regularly attends a class without receiving a grade or credit for it.', 'Graduate', 4, 1),
('BU5570', 'BU', 'Federal Tax I', 'It aims at developing crucial professional skills dealing with personal income tax regulations, ethics and equity, global perspective and court decisions. The course seeks to enhance critical learning skills through tax planning cases.', 'Graduate', 4, 1),
('BU7545', 'BU', 'Financial Reporting, Analysis &', 'An advanced examination of Generally Accepted Accounting Principles (GAAP) underlying financial statement preparation and disclosure, with an emphasis on the analysis and use of financial information in making business decisions. The course provides students with the technical underpinnings of GAAP and its relationship to decision making, as well as an understanding of the ethical responsibilities created by the reliance of various sectors of society upon financial statements. Topics include: the income statement, balance sheet, statement of cash flows, earnings quality, financial instruments, leases, income taxes, and pensions. A term project is required. Offered once a year', 'Graduate', 4, 1),
('BU7547', 'BU', 'International Accounting & Reporting', 'This course familiarizes students with international accounting and reporting issues including a critical analysis of International Financial Reporting Standards (IFRS) versus U.S. GAAP. The course examines how national standards have developed historically and how standards differ among types of countries, including those of developed versus emerging countries. Issues relating to international transactions, foreign currency translation and hedging practices are covered. The analysis of international financial statements, accounting for changing prices and taxation issues in international firms are also discussed. Offered once a year', 'Graduate', 4, 1),
('BU7555', 'BU', 'Accounting Information Systems 3 3', 'The course provides an overview of the interaction of accounting professionals with computer- based information systems (CBIS) and the use of information technology (IT). Developments such as the Internet, e-commerce, databases, and artificial intelligence have transformed the way business organizations conduct their activities. The course stresses the necessity for accountants to participate in the design of information systems, to be able to measure and evaluate the performance of information systems, and to assess the quality of information processing. Offered every semester. ', 'Graduate', 4, 1),
('BU7556', 'BU', 'Advanced Auditing and Assurance', 'Building on the foundation created in an introductory course, this course enhances the understanding of fundamental concepts of auditing and provides in-depth exposure to the auditor’s legal liability and professional responsibilities and to specific topics within the auditing process (e.g., analytical review procedures, internal control issues, fraud detection, statistical and non-statistical sampling methods, and the use of computers in auditing). It also provides exposure to the emerging value-added assurance services decision makers are increasingly demanding in the information age. Topics are covered using text material, real-world case studies, current articles, a research project, and interactive assurance service projects utilizing Internet links. Offered every semester. ', 'Graduate', 4, 1),
('BU7560', 'BU', 'Fraud Examination ', 'A study of the accountant’s role in the examination of fraud allegations and fraud prevention, including: the recognition and detection of fraud, use of controls to prevent fraud, and limited engagements related to fraud, errors and irregularities. Offered every semester', 'Graduate', 4, 1),
('BU7562', 'BU', 'Business Valuation for Forensic Accountants', 'This course explores the basics of business valuation: how businesses are valued, how to evaluate the credentials of self-styled valuation “experts”, and the quality of the report they produce. Students will learn the three methods of valuation, their strengths and weaknesses, and when to apply each. The course explores how professionals use valuation principles. Most importantly, students will engage in interactive exercises to learn how to procure valuation reports which are more likely to survive audit by the IRS or FTB. Guest speakers may present, or students may report on various projects that they have been conducting either independently or in groups. Offered according to demand', 'Graduate', 4, 1),
('BU7563', 'BU', 'Fraudulent Financial Reporting', 'Financial statement fraud involves intentional misstatements or omissions of financial statement amounts or disclosures to deceive users of the statements. Students will learn how and why financial statement fraud is committed, how such conduct can be deterred, and how allegations of fraud should be investigated and resolved. Students will understand and detect the creative accounting methods employed by management along with related fraud prevention strategies. In addition to covering the material in the textbook, class sessions will be interactive, with students working through cases, developing investigative strategies, and seeking to prove how the fraud was committed. Guest speakers who are experts in this area will discuss actual events. Projects will be conducted independently and in groups', 'Graduate', 4, 1),
('BU7564', 'BU', 'Special Topics in Fraud Examination', 'This course covers important topics associated with modern forensic accounting and fraud examination.', 'Graduate', 4, 1),
('BU7565', 'BU', 'Forensic Interviewing, Fraud and the Law', 'Instruction and skill development in interviewing, and note-taking in the criminal justice context. Development of skills to conduct investigations by interviewing witnesses, victims, and suspects properly. This course is designed to further the student’s knowledge of the contemporary legal environment faced by forensic accountants. Topics covered include the Federal Rules of Evidence (including the Daubert rule), the Federal Rules of Civil and Criminal Procedure, the Foreign Corrupt Practices Act, the Federal False Claims Act, the grand jury, expert witness testimony, laws that preserve the rights of suspects and witnesses, including those pertaining to searches and seizures, arrest, the privilege against self-incrimination, and laws related to money laundering and terrorist financing (e.g., USA Patriot Act), wire fraud, mail fraud, and other fraud-related offenses. The course also provides an overview of offshore entities such as trusts and shell corporations. Other important topics the course examines are asset tracing and asset forfeiture alternative dispute resolution', 'Graduate', 4, 1),
('BU7566', 'BU', 'Criminology/White-Collar Crime', 'Psychological and sociological motivations of fraud perpetrators will be examined in depth. Crimes committed by “respectable people” in positions of responsibility in private or public sector will be studied, looking at similarities and differences in behaviors. Critical readings of Sutherland, Cressey, and others are contrasted with more recent perspectives on illegal developments and corporate violations. Wall Street executives, corporate and government officials and high tech computer wizards give a new focus to white collar crime. Discusses the nature of these crimes, how regulatory bodies and legal systems treat these criminals and how they seek to avoid detection and prosecution. The impact of this type of crime on individuals, organizations and society will be discussed', 'Graduate', 4, 1),
('BU7567', 'BU', 'Computer Forensics', 'The purpose of this course is to explain and promote the use of computer forensic technology and methodologies used in both proactive and reactive forensic accounting engagements. Forensic technology and detailed computer examinations have become more commonplace in today’s forensic investigative environment, and the use of computer forensic analysis, ediscovery, and forensic data analysis is often a necessary component of any forensic accounting engagement. While most accounting professionals are not trained technologists, due to the ever changing investigative landscape, it is becoming increasingly important that accountants have an adequate base-level understanding of the current state of computer forensic and data analytical technology tools.', 'Graduate', 4, 1),
('BU7568', 'BU', 'Forensic Documents Examination', 'Students completing this will have gained knowledge in handwriting identification, print process identification, and the court system', 'Graduate', 4, 1),
('BU7570', 'BU', 'Taxation for Corporate Managers ', 'This course addresses the issues of taxation relevant to corporations, partnerships and Limited Liability Company and Limited Liability Partnership entities. Topics include the tax considerations in selecting the form of business entity, passive activities, Section 351 and corporate formations, C Corporation operations, S Corporations, partnerships, and multi-state taxation. Offered every semester', 'Graduate', 4, 1),
('BU7576', 'BU', 'Specialized Topics: Tax Fraud', 'This course focuses on complex frauds (including financial statement fraud, tax fraud and money laundering), and on non-fraud forensic accounting engagements', 'Graduate', 4, 1),
('BU7590', 'BU', 'Accounting Research: Cases &', 'This is the capstone course for the Master of Science in Accounting. The course emphasizes the process of professional research by accounting professionals and provides students with a hands- on ability to use the various research sources and tools in the functional areas of financial accounting, auditing and taxation. It is designed to enhance student’s critical thinking skills through the examination of current topics and controversies, analysis of complex situations and effective communication, use of case materials, and a term project. Offered once a yea', 'Graduate', 4, 1),
('BU7591', 'BU', 'Forensic & Accounting Research', 'This is an integrative capstone course which makes use of the content learned in other forensic accounting courses. There will be the integration of legal, behavioral and technical aspects of forensic accounting investigations. Review of the Fraud Examiners Manual (ACFE), the essential resource for anti-fraud professionals, to prepare students for the CFE examination. Case analysis and presentations will emphasize analytical and writing skills while affording an opportunity to apply investigative procedures used in practice. Students will take part in a culminating activity such as a moot court exercise, which pulls together the data analysis, interviewing and other skills developed in the program. IRS Special Agent Training: The Adrian Project – A day long mock criminal investigation. The Adrian Project gives students interested in IRS Criminal Investigation a chance to try their hand at finding and examining evidence and using surveillance techniques all while working side by side with real IRS Criminal Investigation agents.', 'Graduate', 4, 1),
('BU7651', 'BU', 'Case Studies in Fraud Examination', 'This course covers important topics associated with modern forensic accounting and fraud examination.', 'Graduate', 4, 1),
('BU7760', 'BU', 'Global Finance ', 'In this course, the characteristics and behavior of a firm operating in international financial markets are explored. Multinational firms (multinationals) are offered dramatically expanded opportunities for profitable investments through their participation in international financial markets. However they are also exposed to a variety of risks derived from the particular cultural, political, regulatory, economic, financial and currency systems in which they operate. Participants in this course will be introduced to the critical importance of foreign exchange risk faced by the multinational and its relevance to traditional financial decision making. Offered every semester', 'Graduate', 4, 1),
('CP2120', 'CP', 'Principles of Chemistry I with Lab ', 'Introduction to the origins and principles of modern chemistry. Discussion of atomic and molecular structure, stoichiometry, periodicity, bonding and states of matter. Principles are illustrated through demonstrations and study of descriptive chemistry. Offered every semester.', 'Undergraduate', 4, 1),
('CP2130', 'CP', 'Principles of Chemistry II with Lab ', 'Continuation of Principles of Chemistry I. Discussion of acid/base and oxidation/reduction reactions, equilibrium, kinetics and electrochemistry. Principles are illustrated through demonstrations and study of descriptive chemistry. Offered every semester.', 'Undergraduate', 4, 1),
('CP2240', 'CP', 'General Physics I with Lab', 'The first semester of a calculus-based introductory physics course primarily for chemistry and math majors. Kinematics, energy, momentum and rotational motion are included. Offered every Fall.', 'Undergraduate', 4, 1),
('CP2250', 'CP', 'General Physics II with Lab', 'The second semester of a calculus-based general physics course. Optics, electricity, wave motion and magnetism are included. Offered every Spring.', 'Undergraduate', 4, 1),
('CP2260', 'CP', 'General Physics III with Lab', 'The third course in the General Physics sequence provides an overview of the fundamentals and analytical methods of physics.  Students will learn to think logically and quantitatively about the behavior of nature and gain a systematic approach to problem solving.  This course will cover selected classical topics, including harmonic oscillations, waves, optics, and fluid mechanics, as well as an introduction to select topics in modern physics, including special relativity, quantum mechanics, atomic, nuclear, and particle physics. Students enrolled in CP 2260 General Physics III should concurrently enroll in the associated lab course, CP 2261 General Physics III Lab.', 'Undergraduate', 4, 1),
('CP3230', 'CP', 'Math Methods in Physical Sciences ', 'This course covers a broad spectrum of mathematical techniques essential to the solution of advanced problems in physics and engineering.', 'Undergraduate', 4, 1),
('CP3300', 'CP', 'Organic Chemistry I with Lab ', 'The first semester of an introductory organic chemistry course. Discussion of major classes of organic compounds, with emphasis on structure, reactions, synthesis, stereochemistry and reaction mechanism. Offered every Fall.', 'Undergraduate', 4, 1),
('CP3310', 'CP', 'Organic Chemistry I with Lab ', 'Continuation of Organic Chemistry I, with discussion of additional major classes of organic compounds. Offered every Spring.', 'Undergraduate', 4, 1),
('CP3600', 'CP', 'Mechanics ', 'Learn the physics of how things move with this calculus-based course in mechanics.', 'Undergraduate', 4, 1),
('CP3700', 'CP', 'Electromagnetism ', 'The course presents the principles of electromagnetic (EM) fields and their propagation, power and energy contents, and their properties in guided and unguided structures. It aims to bridge between circuit theory and the EM fields through detailed treatment of guided structure, particularly transmission lines.', 'Undergraduate', 4, 1),
('CP3800', 'CP', 'Relativity ', 'This course offers an intensive exploration of one of the fundamental principle of physics –relativity.', 'Undergraduate', 4, 1),
('CP3900', 'CP', 'Experimental Physics & Electronics Lab ', 'Introductory laboratory electronics, intended for Physics and Engineering Physics majors but open to all students with science or engineering interests in analog circuits, instrumentation and signal processing. The first part of the course is focused on hands-on exercises that build skills needed for measurements, including input/output impedance concepts, filters, amplifiers, sensors, and fundamentals of noise in physical systems. Lab exercises include DC circuits, RC and diode circuits, applications of operational amplifiers, optoelectronics, synchronous detection, and noise in measurements. The second portion of the class is an instrumentation design project, where essential instrumentation for a practical lab measurement is designed, constructed and applied for an experiment.', 'Undergraduate', 4, 1),
('CP4100', 'CP', 'Thermodynamics ', 'Students learn the First Law of Thermodynamics (utilizing heat, energy, work, enthalpy) and the Second Law of Thermodynamics (and the property of entropy) and their macroscopic and microscopic implications. The course focuses on the application of thermodynamics to engineering systems.', 'Undergraduate', 4, 1),
('CP4200', 'CP', 'Quantum Mechanics ', 'A course designed to introduce students to quantum mechanics. An introduction to modern quantum mechanics as applied to the hydrogen atom, molecules, and solids. If you do not learn quantum mechanics, then you will not understand the major developments of science, from electronic gadgets to stars.', 'Undergraduate', 4, 1),
('CP4510', 'CP', 'Biochemistry I', 'Comprehensive coverage of the chemistry and metabolism of biological compounds, including proteins, nucleic acids, lipids, polysaccharides, and their precursors. Also treats enzyme kinetics, bioenergetics and biosynthesis of important biomolecules. Offered every Fall.', 'Undergraduate', 4, 1),
('CP4920', 'CP', 'Seminar 1 ', 'Capstone course in which the student integrates coursework in the sub-disciplines to discuss topics of current interest in the profession. Includes instruction in library resources and on-line searching, scientific writing, ethics workshops and oral presentations. Students choose a supervisor and seminar topic and submit a draft written report. Attendance at Science Seminar Series is required. Offered every Fall.', 'Undergraduate', 4, 1),
('CP4921', 'CP', 'Seminar 2 ', 'Continuation of CP5920. Emphasis on producing paper in American Chemical Society format. Attendance at Science Seminar Series is required. Offered every Spring.', 'Undergraduate', 4, 1),
('CR1500', 'CR', 'Introductory Criminology I', 'This course is an introduction to the study of the crime from the sociological perspective. The course will be an examination of sources of crime, societys reaction to crime, and the criminal justice system.', 'Undergraduate', 4, 1),
('CR1510', 'CR', 'Introduction to Criminology II', 'This course is an introduction to the study of the crime from the sociological perspective. The course will be an examination of sources of crime, societys reaction to crime, and the criminal justice system.', 'Undergraduate', 4, 1),
('CR2090', 'CR', 'Juvenile Delinquency', 'This course will provide students with the tools to analyze and evaluate juvenile justice policies and programs. The course will be divided into four sections: The nature and Extent of Delinquency, Theories of Delinquency, Research on the Causes of Delinquency, and The Control and Prevention of Delinquency.', 'Undergraduate', 4, 1),
('CR2600', 'CR', 'Criminal Deviance', 'Criminal deviance and the social and legal process of defining crime and punishment are examined. Topics include crime types, criminal careers, theories of crime causation, and an introduction to crime control systems', 'Undergraduate', 4, 1),
('CR3092', 'CR', 'Victimology', 'This course will provide an introduction to theory and research about individuals and specifc populations that have been victimized by interpersonal, institutional and state-sanctioned violence and abuse.', 'Undergraduate', 4, 1),
('CR3093', 'CR', 'Criminal Justice Administration', 'This course introduces the student to conceptual frameworks, theories, and empirical research related to criminal justice administration.', 'Undergraduate', 4, 1),
('CR3094', 'CR', 'Drugs and Society', 'This course examines the use of drugs not only in contemporary American society, but also globally, and satisfes the Sociology Department’s cross-cultural component', 'Undergraduate', 4, 1),
('CR3099', 'CR', 'Sociology of Violence', 'This course provides a sociological inquiry into the various manifestations of violence in societies, including interpersonal forms of violence such as homicide, rape, and physical assault as well as collective forms of violence such as state-sponsored violence, war, genocide, terrorism and torture.', 'Undergraduate', 4, 1),
('CR3117', 'CR', 'Policing Bodies', 'This course examines the implementation of policies of crime control in diverse societies, with concentration on the United States.', 'Undergraduate', 4, 1),
('CR3200', 'CR', 'Crime, Media and Culture', 'This course introduces the student to conceptual frameworks, theories, and empirical research related to criminal justice administration.', 'Undergraduate', 4, 1),
('CR4000', 'CR', 'Gender, Crime and Justice', 'This course will be comprised of material on three main topics: women as offenders, women as victims of gendered violence, and women working in the criminal justice system. Womens involvement in criminal activity has been ignored by traditional criminological theories/theorists.', 'Undergraduate', 4, 1),
('CR4091', 'CR', 'Punishment and Corrections', 'Students are introduced to the sociology of punishment and corrections. The historical development and form of modern corrections systems in the United States are explored', 'Undergraduate', 4, 1),
('CR4270', 'CR', 'Internship in Criminology', 'This course gives students the opportunity to intern and learn about the Criminal Justice system, law enforcement or the legal field.', 'Undergraduate', 4, 1),
('CR4520', 'CR', 'Crime Research Methods I', 'The course emphasizes the application of theory and research, sampling, measurement, data collection, research designs, and ethics of research.', 'Undergraduate', 4, 1),
('CR4550', 'CR', 'Theories of Crime', 'This course offers an advanced exploration of the theories of crime causation.', 'Undergraduate', 4, 1),
('CR4810', 'CR', 'Criminal Law and Justice', 'This course introduces students to the study of criminology by exploring a broad range of issues related to crime and criminal behavior. The course reviews the theoretical foundations and relevant research for understanding the causes of crime, criminal behavior, and systems of punishment within society.', 'Undergraduate', 4, 1),
('CR4999', 'CR', 'Issues in Criminology', 'Gives students the opportunity to examine in greater depth the analysis and discussion of current specialized criminological work in the particular area defned by the instructor', 'Undergraduate', 4, 1),
('CS2510', 'CS', 'Computer Programming I ', 'Basic building blocks of computer programming through Java', 'Undergraduate', 4, 1),
('CS2511', 'CS', 'Computer Programming II ', 'Learning muti-class functions in Java', 'Undergraduate', 4, 1),
('CS3620', 'CS', 'Computer Architecture I ', 'Figuring out the hardware and software functions', 'Undergraduate', 4, 1),
('CS3810', 'CS', 'Data Structures and Algorithms ', 'Abstract data structures and their implementations', 'Undergraduate', 4, 1),
('CS3911', 'CS', 'C++ and Object-Oriented Programming ', 'Object oriented programming involving encapsulation and abstraction', 'Undergraduate', 4, 1),
('CS4100', 'CS', 'Technical Communications ', 'Introducing technical writing and public speaking skills', 'Undergraduate', 4, 1),
('CS4400', 'CS', 'Artificial Intelligence ', 'Introduction to the programming language LISP. Additional topics include:  search as problem-solving paradigm; depth first, breadth first, best first, min/max and alpha beta; state space representation, OR graphs, AND/OR graphs, means end analysis and problem reduction; propositional and predicate logic, skolemization, resolution and theorem proving, semantic nets, frames, neural nets and genetic algorithms. Students write programs in LISP and C++/Java. Offered every other year.', 'Undergraduate', 4, 1),
('CS4444', 'CS', 'Hacking', 'Testingtttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttttt', 'Undergraduate', 2, 1),
('CS4501', 'CS', 'Software Engineering ', 'Developing large constructs out of small programs', 'Undergraduate', 4, 1),
('CS4550', 'CS', 'Database Management Systems ', 'Going over concepts such as data schema and entity relations', 'Undergraduate', 4, 1),
('CS4610', 'CS', 'Operating Systems ', 'Memory management:  multiprogramming, relocation, paging, virtual memory, dynamic loading and linking. Process management:  job scheduling, process scheduling and synchronization, multiprocessing. Device management:  input/output, channels and control units, buffering, interrupt structure and processing. Information management:  logical and physical file systems, file processing. OS examples:  Unix/Linux, Windows.', 'Undergraduate', 4, 1),
('CS4705', 'CS', 'Computer Security ', 'This course covers basic ideas of computer and network security and fundamental techniques for defending computers and networks against adversaries. The course introduces the students to: secure software engineering, operating system security, network security, cryptography, cryptographic protocols, denial of service attacks, firewalls, authentication techniques, web and server security. Students will work on programming projects individually and/or jointly in groups. Offered once a year.', 'Undergraduate', 4, 1),
('CS4710', 'CS', 'Applied Cryptography ', 'This course develops notions of information security and deals with the tools for guaranteeing secure communications in an adversarial setting. Topics include basic number theory, cryptographic methods, key distribution, and protocols for authentication and confidential communications. The course examines C++/Java security applications that employ cryptography. Students will be assigned several small programs incorporating security. Offered once a year', 'Undergraduate', 4, 1),
('CS4711', 'CS', 'Computer Networks ', 'Presenting network applications based on the client server model', 'Undergraduate', 4, 1),
('CS4720', 'CS', 'Internet and Web Technologies ', 'Introduction to TCP/IP protocols and HTML techniques', 'Undergraduate', 4, 1),
('CS4721', 'CS', 'Advanced Java Programming and Applications ', 'A second course in Java programming focusing on advanced language features. ... Utilize web-enabled documentation techniques for Java applications.', 'Undergraduate', 4, 1),
('CS4730', 'CS', 'Computer Network Security ', 'This course is a continuation of CS4710 and deals with the issues in network security. Topics include Kerberos, public key infrastructures, electronic mail security, IP security, Web security, intrusion detection and response, password management, viruses and worms, firewalls, denial of service attacks and defenses, wireless security, and privacy. Students will write several small programs including a network application incorporating security. Offered once a year.', 'Undergraduate', 4, 1),
('CS4810', 'CS', 'Data Mining ', 'Learning techniques useful in searching large data sets', 'Undergraduate', 4, 1),
('CS4910', 'CS', 'System Design & Implementation ', 'Designing and implementing systems meant to hold and interact with large amounts of data', 'Undergraduate', 4, 1),
('CU1101', 'CU', 'Culinary Sanitation', 'This course will be the first formal introduction to the most important aspect of food preparation: sanitation.', 'Undergraduate', 4, 1),
('CU1110', 'CU', 'Introduction to Culinary Arts', 'Students will gain a working knowledge of the fundamentals of kitchen operations, basic knife skills; an overview of stock, sauce and soup preparation; and coverage of the primary dry heat, moist heat and combination heat cooking methods.', 'Undergraduate', 4, 1),
('CU1120', 'CU', 'Classical French Cuisine', 'This course is designed to reinforce the classical culinary kitchen as established by Escoffier', 'Undergraduate', 4, 1),
('CU1130', 'CU', 'American Regional Cuisine', 'The course is designed to acquaint the student with the international and classical cuisines of the world.', 'Undergraduate', 4, 1),
('CU1140', 'CU', 'Baking I', 'This course is designed to educate students in the art of Baking and. Pastry Arts.', 'Undergraduate', 4, 1),
('CU1162', 'CU', 'Hospitality Human Resources', 'This course examines the theoretical and hands-on applications of management and supervisory practices in the hospitality industry.', 'Undergraduate', 4, 1),
('CU1165', 'CU', 'Facilities Planning and Design ', 'The purpose of this course is to make an introduction to planning and design of manufacturing facilities.', 'Undergraduate', 4, 1),
('CU1171', 'CU', 'Food and Beverage Operations', 'An examination of the challenges in operating food and beverage outlets as well as on- and off-premise catering.', 'Undergraduate', 4, 1),
('CU1172', 'CU', 'Food Services Cost Analysis', 'Food and Beverage Cost Control details the cost control procedures found within the hospitality industry.', 'Undergraduate', 4, 1),
('CU1175', 'CU', 'Food and Beverage Merchandising', 'A course providing students with techniques and international methods of tourism, culinary arts, hotel/restaurant management.', 'Undergraduate', 4, 1),
('CU1178', 'CU', 'Event Planning', 'Interviewing clients, determining budgets and expectations, evaluating and booking venues, vendors, and accommodations—our students graduate with an in-depth understanding of what it takes to plan and execute a successful event.', 'Undergraduate', 4, 1),
('CU1190', 'CU', 'International Wines and Beverages', 'Explore the wide world of wine, beer and spirits, through lectures, sensory evaluations, and in-class tasting exercises.', 'Undergraduate', 4, 1),
('CU2210', 'CU', 'Culinary Nutrition', 'Fundamental culinary nutrition principles and theories for various groups are investigated.', 'Undergraduate', 4, 1),
('CU2220', 'CU', 'International Cuisine', 'The study of classical cooking skills associated with the preparation and service of international and ethnic cuisines. Topics include similarities between food production systems used in the United States and other regions of the world. Understand the food and nutrition of different regions of the world.', 'Undergraduate', 4, 1),
('CU2230', 'CU', 'Garde Manger', 'This course exposes students to the preparation of brunch items, fish and shellfish, hot and cold hors d oeuvres, cold canapes, cold plated entrees, and specialty sandwiches as well as the design of salad bar setups.', 'Undergraduate', 4, 1),
('CU2240', 'CU', 'Baking II ', 'The Baking II course utilizes lectures, demonstration and cooking for an integrated approach to mastering the fundamentals of baking. This course provides students with the skills and knowledge of producing cakes, butter creams, and icings. Each student is taught proper mixing methods, assembling, icing, and finishing techniques of a variety of cakes and pies. Students are introduced to rolled fondant and develop their piping skills through intricate patterns and techniques. Students will learn how to temper chocolate for the use of fillings and decorative pieces.', 'Undergraduate', 4, 1),
('CU2245', 'CU', 'Commercial Baking', 'designed to train students for entry-level positions in diverse food service operations. The program focuses on the preparation of classic and modern desserts, artisan and specialty breads, breakfast pastries, decorative showpieces and special occasion cakes. Students are exposed to all areas of a professional baking environment that includes baking techniques, safety and sanitation, food service management, professionalism and ethics, teamwork and communication.', 'Undergraduate', 4, 1),
('CU2250', 'CU', 'Dining Room Service', 'Employ principles of dining room organization, scheduling and management of food service personnel.', 'Undergraduate', 4, 1),
('CU2255', 'CU', 'Advanced Dining Room and Banquet Operations', 'emphasis on the service aspects of a business that will distinguish an outstanding dining experience.', 'Undergraduate', 4, 1),
('CU2260', 'CU', 'Quantity Food Production', 'This course is a study of the preparation of food items in large foodservice operations.', 'Undergraduate', 4, 1),
('CU2265', 'CU', 'Culinary Seminar', 'In the Culinary Seminar, students will develop professional skills needed to market themselves in the workplace. They will be required to design personal portfolios and resumes, create self-marketing strategies and/or business plan. Topics of discussion will include business development skills including financial reconciliation; the use of technology in food service; “Green” techniques and strategies; labor planning and forecasting as well as inventory, receiving and storage. Guest lecturers and professional demonstrations will be included along with “networking” events. SUNY GEN ED-n/a; NCC GEN ED-n/a Offered: Fall, Spring', 'Undergraduate', 4, 1),
('ED3330', 'ED', 'Children’s Literature', 'An introduction to the study of literature for children in the pre-school and elementary grades. The course includes, selection and evaluation of books for children; language development through children’s literature; use of literature to promote the social, emotional and creative development of children; integrating children’s literature into the content areas; planning story activities. Opportunities to work with children ages 3-7 where feasible.', 'Undergraduate', 4, 1),
('ED3700', 'ED', 'Child Development', 'Practices for teachers to insure optimal child development', 'Undergraduate', 4, 1),
('ED3742', 'ED', 'Middle Childhood and Adolescence', 'Examines human development from six years through adolescence. Research and theories concerning physical, cognitive, personality and social development will be reviewed. Family, peer groups, schools and media will be discussed. The impact of socioeconomic background, culture, race and gender will be discussed throughout. The use of theories and research in applied settings will be discussed.', 'Undergraduate', 4, 1),
('ED3820', 'ED', 'Foundations of Special Education', 'Foundations basic education principles and practices', 'Undergraduate', 4, 1),
('ED3900', 'ED', 'Foundations of Education', 'Foundations basic education principles and practices', 'Undergraduate', 4, 1),
('ED4050', 'ED', 'Innovative Instructional Design and Assessment', 'This course provides background information for developing curriculum. Emphasis is given to the preparation of lesson plans and unit plans using backwards design. Students will obtain skills in developing objectives, designing instruction and assessment based on Common Core standards. Throughout the course, students will demonstrate competence by creating lesson plans and a unit plan.', 'Undergraduate', 4, 1),
('ED4082', 'ED', 'Methods and Materials of Teaching Mathematics', 'This course is a study of the strategies, techniques, materials, and technology used to teach mathematics to middle childhood and high school students. Candidates will become acquainted with New York State learning standards involved in teaching mathematics at the secondary school level, develop an awareness of the professional environment, and of resources and information available for teachers. There will be a strong focus on unit and lesson planning, assessment methods, interdisciplinary connections and differentiated instruction. The co-requisite Observation course provides an opportunity for candidates to observe and interact with teachers and students in a secondary feld placement setting, and to refect on these experiences.', 'Undergraduate', 4, 1),
('ED4083', 'ED', 'Methods and Materials of Teaching Spanish', 'This course is a study of the strategies, techniques, materials, and technology used to teach mathematics to middle childhood and high school students. Candidates will become acquainted with New York State learning standards involved in teaching mathematics at the secondary school level, develop an awareness of the professional environment, and of resources and information available for teachers. There will be a strong focus on unit and lesson planning, assessment methods, interdisciplinary connections and differentiated instruction. The co-requisite Observation course provides an opportunity for candidates to observe and interact with teachers and students in a secondary feld placement setting, and to refect on these experiences.', 'Undergraduate', 4, 1),
('ED4085', 'ED', 'Methods and Materials of Teaching Science', 'This course is a study of the strategies, techniques, materials, and technology used to teach science to middle childhood and high school students. Candidates will become acquainted with New York State learning standards involved in teaching science at the secondary school level, develop an awareness of the professional environment, and resources and information available for teachers. There will be a strong focus on unit and lesson planning, assessment methods, interdisciplinary connections and differentiated instruction. The co-requisite Observation course provides an opportunity for candidates to observe and interact with teachers and students in a secondary feld placement setting, and to refect on these experiences.', 'Undergraduate', 4, 1),
('ED4086', 'ED', 'Methods & Materials of Teaching Social Studies', 'This course is a study of the strategies, techniques, materials, and technology used to teach social studies to middle childhood and high school students. Candidates will become acquainted with New York State learning standards involved in teaching social studies at the secondary school level, develop an awareness of the profes- 186 sional environment, and resources and information available for teachers. There will be a strong focus on unit and lesson planning, assessment methods, interdisciplinary connections and differentiated instruction. The co-requisite Observation course provides an opportunity for candidates to observe and interact with teachers and students in a secondary feld placement setting, and to refect on these experiences.', 'Undergraduate', 4, 1),
('ED4121', 'ED', 'Methods and Materials for Teaching Elementary Science Majors', 'Practical student teaching: Science', 'Undergraduate', 4, 1),
('ED4122', 'ED', 'Methods and Materials for Teaching Elementary Math Methods', 'Practical student teaching: Math', 'Undergraduate', 4, 1),
('ED4200', 'ED', 'Literacy for All Students', 'Basics of literary education across all educational levels', 'Undergraduate', 4, 1),
('ED4220', 'ED', 'Language Arts in the Context of Childhood Education', 'Education concepts regarding the study of language arts across all eudcational levels', 'Undergraduate', 4, 1),
('ED4230', 'ED', 'Reading Across the Curriculum', 'This course focuses on current approaches to literacy instruction across the curriculum. It is designed for secondary teacher candidates, and addresses specifc instructional strategies appropriate for the adolescent population. Emphasis will be placed on theoretical models of reading, instructional strategies, assessment techniques, strategies specifc to multicultural and bilingual learners.', 'Undergraduate', 4, 1),
('ED4231', 'ED', 'Reading Across the Curriculum Practicum', 'The purpose of this course is to provide adolescence and middle childhood education candidates with an opportunity to observe literacy strategies in various discipline settings. The course goal is to familiarize candidates with differentiation of instruction and methodology for diverse / multicultural populations. Candidates will also become familiar with the strategic needs of learners with exceptionalities. Candidates will observe students in a bilingual and/or ESL classroom, and maintain a refective journal.', 'Undergraduate', 4, 1),
('ED4300', 'ED', 'Assessment and Evidencebased Decision Making in Special Education', '', 'Undergraduate', 4, 1),
('ED4810', 'ED', 'Positive Behavior Supports and Interventions for Students with Disabilities', '', 'Undergraduate', 4, 1),
('ED4850', 'ED', 'Instructional Design & Delivery for Students with Disabilities', '', 'Undergraduate', 4, 1),
('ED4890', 'ED', 'Effective Practices for Students with Low Incidence Disabilities', '', 'Undergraduate', 4, 1),
('ED6000', 'ED', 'Foundations of Education', 'This course focuses on the development of learners from birth through adolescence, their phases of learning, their intellectual, social, and emotional growth, character development, individual differences, interests, attention, and motivation. The teacher candidates will understand how these aspects of human growth and development relate and influence the teaching/learning process.', 'Graduate', 4, 1),
('ED6001', 'ED', 'Human Growth & Development', 'This course focuses on the development of learners from birth through adolescence, their phases of learning, their intellectual, social, and emotional growth, character development, individual differences, interests, attention, and motivation. The teacher candidates will understand how these aspects of human growth and development relate and influence the teaching/learning process', 'Graduate', 4, 1),
('ED6002', 'ED', 'Foundations of Literacy', 'This course examines literacy as an evolving language process. Theories of language acquisition will be addressed as a primary aspect of communication. The focus of this course will be communication aspects of literacy which includes listening, speaking (oral language), reading, and writing. These aspects are consistent with the NYS ELA Standards. An integral part of this course will be the elements of critical thinking. (Emphasis will be placed on topics such as: constructing meaning to convey information, the role of explicit instruction, vocabulary enhancement, assessing language, and the importance of literature enrichment.)', 'Graduate', 4, 1),
('ED6003', 'ED', 'The Exceptional Learner', 'This course provides an introduction to the categories of exceptionality and the rules and regulations concerning the provision of special education and related services. There will be a focus on advanced professional, legal, and ethical standards. Advocacy and student services advocacy, and the application of computer-based technologies specific to working with students with disabilities will also be addressed', 'Graduate', 4, 1),
('ED6082', 'ED', 'Methods of Teaching Science', 'Introduction to the main issues involved in teaching science at the secondary school level. The course has a focus on inquiry-driven methods consistent with current standards in science education, uses of technology and relevant software, teaching strategies, assessment, and inclusion of special student populations. The course is structured to enhance the development of science literacy, critical thinking, and problem solving with an emphasis on the teacher-as-learner. Fieldwork under supervision', 'Graduate', 4, 1),
('ED6083', 'ED', 'Methods and Materials of Teaching English', 'In this course teacher candidates will investigate the current trends in teaching English Language Arts to both middle and high school students. Methodologies and strategies for creating student-centered classrooms and teaching curriculum including various literary genres, the writing process, and grammar to diverse learners will be modeled and explored. Topics such as designing lesson and unit plans, creating and using appropriate and varied assessment tools, integrating standardized test preparation, and implementing classroom management techniques will also be examined. As part of this course, teacher candidates will be required to participate in a field experience in the secondary schools. Fieldwork under supervision.', 'Graduate', 4, 1),
('ED6084', 'ED', 'Methods and Materials of Teaching Mathematics', '', 'Graduate', 4, 1),
('ED6092', 'ED', 'Literacy, Research, & Technology in Science', 'Introduction to research and practice in the analysis of syntax (rules and structure) and semantics (what is meant) within specific disciplines; reasons why many modern textbooks have removed logical connectives in order to improve readability; science learning involves words of increasing level of abstraction such as giving familiar objects new names, and giving new names to unfamiliar objects; process words like evaporation, distillation, condensation, evolution; concept words like work, energy, power, heat, force, an area where most learning difficulties are encountered; mathematical language as it applies to scientific measurements with an emphasis on graphical understanding of the uses of microcomputer-based laboratory techniques. The course includes field experience in the secondary schools. Fieldwork under supervision.', 'Graduate', 4, 1),
('ED6093', 'ED', 'Discipline Specific Literacy, Research, & Technology in English', 'In this course, teacher candidates will develop an understanding of the language and literacy development of middle and high school students, as well as the role of cultural and linguistic diversity in literacy learning. The major sources of research, theory, and issues and trends that influence the content and pedagogy of English 111Language Arts will be investigated and the integration of reading, writing, speaking, listening, technology, and a wide range of media to enhance instruction will be explored. The course includes field experience in the secondary schools. Fieldwork under supervision.', 'Graduate', 4, 1),
('ED6094', 'ED', 'Literacy, Research, & Technology in Mathematics', 'Mathematics is highly conceptual and process- oriented. Reading and writing play a critical role in the mathematical learning processes. This course focuses on current research on reading: how to help students become proficient in reading and communicating in mathematics; activities and strategies to enhance literacy skills while building abilities in math. Each semester, a content topic will be chosen from current secondary school curriculum and students will learn to integrate literacy into the teaching of mathematics. The course includes field experience in the secondary schools. Fieldwork under supervision', 'Graduate', 4, 1);
INSERT INTO `course` (`course_ID`, `dept_ID`, `course_Name`, `course_Desc`, `Type`, `course_Credit`, `ACTIVE`) VALUES
('ED6100', 'ED', 'Probability and Statistics', 'This course presents the mathematical laws of random phenomena, including discrete and continuous random variables, expectation and variance, and common probability distributions such as the binomial, Poisson, and normal distributions. Topics also include basic ideas and techniques of statistical analysis such as descriptive statistics, frequency distributions and graphs, measures of central tendency, measures of dispersion, correlation, inferential statistics and hypothesis testing and error. Structures and problems relevant to the secondary mathematics curriculum will be addressed. ', 'Graduate', 4, 1),
('ED6200', 'ED', 'Algebra', 'This course is a rigorous course in Abstract Algebra. Topics include theory of groups, rings, fields and basic number theory. Structures and problems relevant to the secondary school mathematics curriculum will be addressed', 'Graduate', 4, 1),
('ED6250', 'ED', 'Teaching the Nature and Development of Science', 'Introduction to the development of science as a topic that helps teachers synthesize their learning of various scientific disciplines. The emphasis is on providing a philosophical and historical approach to the emergence of science as a distinctive way to look at nature. Candidates deal with issues pertaining to the teaching of various scientific ideas and their impact on larger societal issues. The course addresses National Science Education Standards that call for an understanding of the history and development of science, as well as its interdisciplinary nature.', 'Graduate', 4, 1),
('ED6255', 'ED', 'Analysis', 'This course provides an introduction to rigorous real analysis. Topics include the real number system, sequence and series of real numbers, topology of the real line, limits and continuity, sequence and series of functions, differentiability and integrability of functions', 'Graduate', 4, 1),
('ED6510', 'ED', 'Geometry', 'This course is aimed at mathematics teachers who are interested in enhancing their understanding of basic and advanced topics in geometry. It aims to give teachers a foundation in the fundamental working and structure of the field, both from a historical perspective and through the examination of both Euclid’s work and modern geometry, including non-Euclidean systems. Students will learn how to use Dynamical Geometry Software. Topics include use of dynamical geometry software, classical geometry with constructions, axiomatics and proof, Euclidean geometry, coordinate geometry and vectors, transformations, non-Euclidean geometry, historical background of Euclidean and non-Euclidean geometries, and three-dimensional geometry and spatial reasoning.', 'Graduate', 4, 1),
('ED6515', 'ED', 'Foundations of U.S Literature', 'Foundations of U.S. Literature examines the literary traditions of the United States. It provides a focused study of one or more literary periods or of a literary theme as it develops across time periods. This course examines literary elements, techniques, genres, and traditions. A central focus will be the interrelationship between literature and its cultural-historical context. Requirements include analysis papers, oral assignments, and research projects.', 'Graduate', 4, 1),
('ED6520', 'ED', 'Foundations of English Literature', 'This course maps and interprets the literary traditions of the United Kingdom. It locates the origin of many themes of American literature in the British canon, and examines the development of English Literature in parallel with history and the role of tradition in the formation of identity. A central focus will be the interrelationship between the text and its cultural-historical context. Requirements include analysis papers, oral assignments, and research projects', 'Graduate', 4, 1),
('ED6530', 'ED', 'Topics in Multicultural Literature', 'This course explores the diverse contributions of writers from a variety of ethnic backgrounds and geographical areas within the United States and England. Students engage the literary traditions of a particular cultural group or learn to make cross-cultural comparisons of literary traditions of more than one cultural group', 'Graduate', 4, 1),
('ED6540', 'ED', 'Topics in World Literature', 'This course examines literature in translation from a single country or region or offers a cross-cultural analysis of literature in translation from a particular literary time period. Emphasis is placed on both genre and technique, and the cultural-historical dimensions of the literature.', 'Graduate', 4, 1),
('ED6550', 'ED', 'Rhetoric and Compassion', 'This course is a survey of classic and current texts on the teaching of writing. Texts are selected on the basis of usefulness to the junior high and high school teacher and will include theories in the teaching of grammar, developing writing according to purpose and audience, engaging students, responding to writing, and assessment.', 'Graduate', 4, 1),
('ED6560', 'ED', 'Topics in Molecular Biology & Biochemistry', 'This course will discuss state-of-the-art understanding of the biology of aging and longevity, considering what we know, what are particular challenges to tackling the problem, what are the controversies, what are the myths. Topics we will consider are genetics, diet, environment, chance, signaling pathways, epigenetics, late onset diseases. Format will be lecture plus reading discussions, emphasis on molecular genetics of longevity and health span.', 'Graduate', 4, 1),
('ED6590', 'ED', 'Topics in Environmental Science', 'Topics include systems analysis (atmosphere, lithosphere, hydrosphere, and biosphere), matter, energy, ecosystems, biodiversity, environmental risk, ozone, water, soil and air pollution, global warming, food resources, and human health.', 'Graduate', 4, 1),
('ED6700', 'ED', 'Topics in Biology', 'Provides rigorous coverage of key areas of biochemistry, physiology, and genetics, which are prerequisite to the understanding of physiological control mechanisms fundamental to modern medical practice. Integration of information and its application to clinical situations is emphasized. The role of genetics in the etiology of various pathological states is also emphasized. Recent advances in molecular biology and reproductive technology and the associated moral, ethical, and legal dilemmas discussed as they relate to patient education and referral situations.', 'Graduate', 4, 1),
('ED6740', 'ED', 'Topics in Earth & Space Science', 'Course topics include an exploration of the major cycles that affect every aspect of life, including weather, climate, air movement, tectonics, volcanic eruptions, rocks, minerals, geologic history, Earths environment, sustainability, and energy resources.', 'Graduate', 4, 1),
('ED6900', 'ED', 'Student Teaching', 'In this course, students have school-based teaching experiences under the guidance of a cooperating teacher and a college supervisor at each school. Seventy-five days of mentored teaching will prepare student teachers to teach effectively both at the middle and high school levels. The mentoring teacher and the university supervisor will observe regularly and provide ongoing formative evaluations in close collaboration with the student. Student teachers will meet with the university supervisor in a weekly seminar throughout the semester. Prerequisites: Completion of all pedagogy and content courses', 'Graduate', 4, 1),
('ED6901', 'ED', 'Student Teaching: English', 'In this course, students have school-based teaching experiences under the guidance of a cooperating teacher and a college supervisor at each school. Seventy-five days of mentored teaching will prepare student teachers to teach effectively both at the middle and high school levels. The mentoring teacher and the university supervisor will observe regularly and provide ongoing formative evaluations in close collaboration with the student. Student teachers will meet with the university supervisor in a weekly seminar throughout the semester. Prerequisites: Completion of all pedagogy and content courses.', 'Graduate', 4, 1),
('ED6902', 'ED', 'Literacy & Technology (Science)', 'In this course, students have school-based teaching experiences under the guidance of a cooperating teacher and a college supervisor at each school. Seventy-five days of mentored teaching will prepare student teachers to teach effectively both at the middle and high school levels. The mentoring teacher and the university supervisor will observe regularly and provide ongoing formative evaluations in close collaboration with the student. Student teachers will meet with the university supervisor in a weekly seminar throughout the semester. Prerequisites: Completion of all pedagogy and content courses', 'Graduate', 4, 1),
('ED6903', 'ED', 'Student Teaching (Mathematics)', 'In this course, students have school-based teaching experiences under the guidance of a cooperating teacher and a college supervisor at each school. Seventy-five days of mentored teaching will prepare student teachers to teach effectively both at the middle and high school levels. The mentoring teacher and the university supervisor will observe regularly and provide ongoing formative evaluations in close collaboration with the student. Student teachers will meet with the university supervisor in a weekly seminar throughout the semester. Prerequisites: Completion of all pedagogy and content courses', 'Graduate', 4, 1),
('ED7001', 'ED', 'Human Growth & Development', 'This course focuses on the development of learners from birth through adolescence, their phases of learning, their intellectual, social, and emotional growth, character development, individual differences, interests, attention, and motivation. Candidates will understand how these aspects of human growth and development relate and influence the teaching/learning process. In this course, candidates will also have the opportunity to conduct a series of systematic observations on children and students of various age groups and in different settings as part of an advanced field component experience. The field experience in this course will include a sequential-cohort research study that will culminate in the analysis of findings and a formal poster presentation.', 'Graduate', 4, 1),
('ED7002', 'ED', 'Foundations of Literacy', 'This course engages the teacher practitioner in examining literacy as an evolving language process among his or her students. The focus of this course will be on the communication aspects of literacy, which include the listening, speaking, reading, and writing that are a part of the teacher practitioner’s classroom. This course also has a strong research component where teacher practitioners will analyze, synthesize, and evaluate current trends in literacy education. Teacher practitioners will be given opportunities to reflect upon and examine their own integration of literacy activities in their content area classrooms. Emphasis will be placed on topics such as: constructing meaning to convey information, the role of explicit instruction, vocabulary enhancement, assessing language, and the importance of literature enrichment.', 'Graduate', 4, 1),
('ED7003', 'ED', 'The Exceptional Learner', 'This course provides an introduction to the categories of exceptionality and the rules and regulations concerning the provision of special education and related services. There will be a focus on advanced professional, legal, and ethical standards. Advocacy and student services advocacy, and the application of computer-based technologies specific to working with students with disabilities will also be addressed. In this course, candidates will also have the opportunity to conduct a series of in depth interviews with individuals directly working and/or receiving special education services as part of an advanced field component experience that will culminate in an analysis of findings and a formal presentation.', 'Graduate', 4, 1),
('ED7083', 'ED', 'Methods and Materials of Teaching English', 'In this course teacher practitioners will investigate and reflect upon the current trends in teaching English Language Arts to both middle and high school students. There will be a strong focus on individual research interests through an annotated bibliography. Teacher practitioners will begin to investigate and analyze current research trends in the field of English education, in addition to participating in their own action research project. Reflection practices will be developed through a videotaped lesson and self evaluations. Methodologies and strategies for creating student-centered classrooms and teaching curriculum including various literary genres, the writing process, and grammar to diverse learners will be modeled and explored in depth. Topics such as the enhancement of the design of lesson and unit plans, the exploration of varied assessment tools, the integration of standardized test preparation, and the use of Young Adult literature will also be examined. Fieldwork may be required for some candidates, as determined by the Program Coordinator.', 'Graduate', 4, 1),
('ED7093', 'ED', 'Literacy, Research, & Technology: English', 'In this advanced course, teacher practitioners will focus on literacy in the secondary English Language Arts classroom, research methods and application, and use of technology to enhance instruction. There will be a strong focus on reflection practices through action research, a videotaped lesson, and self assessments. Topics include the exploration of how proficient reading works, media literacy, the use of non-traditional texts, and methods for student assessment. Teacher practitioners will also be evaluating and synthesizing the current research trends in the field of English education. Fieldwork may be required for some candidates, as determined by the Program Coordinator.', 'Graduate', 4, 1),
('ED7500', 'ED', 'Literature in the Classroom', 'Candidates select a major work or works of U.S., English, or World Literature drawn from the MAT content area curriculum. Examples include a major novel or culturally significant autobiography, a group of important essays by one author, or a related series of important poems by one author. Candidates will conduct research in the cultural-historical background of the work(s) and in significant interpretations of the work(s), including recent interpretations from several different standpoints and will prepare a 15-page paper discussing important interpretive and methodological issues to be discussed in teaching the work(s) in the classroom.', 'Graduate', 4, 1),
('ED7700', 'ED', 'Methods of Research in Educational Settings', 'Introduction to research methodology as it pertains to the teaching of a specific discipline, clarifying the nature of principles that govern the effective use of emerging new research designs. Particular emphasis will be placed on the influential notion that expertise involves a growing competence in ‘finding one’s way’ around a domain and using resources in that domain appropriately and effectively', 'Graduate', 4, 1),
('ED7800', 'ED', 'Thesis Research in Educational Settings', 'The course entails the completion of the thesis project. The emphasis will be on individual discussions and occasional group reports of progress. Discussion of quantitative and qualitative measures and techniques, historical, interpretive, and action research types of theses', 'Graduate', 4, 1),
('EL3100', 'EL', 'Structure and Grammar of English', 'Students at this level have some systematic knowledge of English grammar. In this course students learn more complex grammatical structure.', 'Undergraduate', 4, 1),
('EL3500', 'EL', 'Literature Across Cultures I: Analysis & Interpretation', 'This course explores representative works of the U.S. and international literature that find their roots in the worlds multiplicity of cultures.', 'Undergraduate', 4, 1),
('EL3510', 'EL', 'Literature Across Cultures II: Theory', 'This course examines the literature of the United States from the perspective of minority writers: African, Asian, Hispanic, Chicano and Caribbean Americans.', 'Undergraduate', 4, 1),
('EL3560', 'EL', 'Literatures of Europe Part I', 'A study of literature and film in relation to one another, to critical and aesthetic theories, and to historical context.', 'Undergraduate', 4, 1),
('EL3561', 'EL', 'Literatures of Europe Part II', 'It combines studies on literature, history, anthropology, film, and cultural studies for a richer and more comprehensive understanding of the people', 'Undergraduate', 4, 1),
('EL3600', 'EL', 'U.S. Literature I: Colonial to Civil War', 'This course is a study of American literature from the period of European exploration in the 15th century through to the end of the Civil War.', 'Undergraduate', 4, 1),
('EL3610', 'EL', 'U.S. Literature II: Civil War to Present', 'This course explores literature produced in and about the Americas from the mid-nineteenth to the twenty-first century.', 'Undergraduate', 4, 1),
('EL3700', 'EL', 'Survey of World Literature', 'Survey of World Literature covers literary selections from a wide variety of the world? s cultures. Specifically, it addresses stories, poems and plays from Africa, Asia, the Americas, Europe and the Middle East. It also covers literary genre, critical methodologies, research, and critical thinking.', 'Undergraduate', 4, 1),
('EL3800', 'EL', 'English Literature I: Beowulf to 18th Century, inclusive of Shakespeare', 'This course will provide an overview of English literature from the Anglo-Saxon period through the Middle Ages and into the seventeenth century.', 'Undergraduate', 4, 1),
('EL3810', 'EL', 'English Literature II: Romantics to Present', 'May include study of movements, schools, and/or periods. This is a writing intensive course that requires a written research project.', 'Undergraduate', 4, 1),
('EL3811', 'EL', 'Survey of African American Literature', 'This course emphasizes the trends, patterns and historical incidents that have influenced recurrent themes in African American literature. ', 'Undergraduate', 4, 1),
('EL3950', 'EL', 'Creative Non-Fiction', 'This course is a literary survey of contemporary nonfiction, including the personal essay and narrative nonfiction. Students will investigate the relationship between art and culture, between the writer and his or her society.', 'Undergraduate', 4, 1),
('EL4000', 'EL', 'Native American Literature', 'This course explores Native American literary styles such as autobiography and as-told-to narrative from oral traditions as well as contemporary genres: poetry, short fiction, the novel and drama. Special emphasis on structural and thematic elements provides students with an understanding of the Native American world view. Offered periodically.', 'Undergraduate', 4, 1),
('EL4010', 'EL', 'Harlem Renaissance', 'The Harlem Renaissance of the 1920’s decade produced an unprecedented outpouring of artistic works in the literary, visual, and musical arts. From lectures, close textual analysis of assigned readings, student-centered discussions, and oral reports, the class will become familiar with major themes and key writings of Harlem Renaissance authors. Attention will be paid to the struggles of the “New Negro Woman” in her attempt to find a voice during the period. Offered periodically', 'Undergraduate', 4, 1),
('EL4015', 'EL', 'Multi-Ethnic Literatures of the United States', 'Asian American, Latino, and Native American Literatures play an increasingly important part in the multi-ethnic literary traditions of the United States. This course offers an introduction to one or more of these literatures. Readings include both classic and present-day works in varied genres. The course will include attention to historical contexts, cultural and political meanings, and aesthetic qualities of the literatures. Coverage may vary in different offerings of the course. Offered periodically.', 'Undergraduate', 4, 1),
('EL4020', 'EL', 'Asian American Literature', 'This course examines memoirs, stories, novels, essays, poems, dramas, and films from the 1890s to the 1990s, by Americans of diverse Asian descent, such as Sui Sin Far, Younghill Kang, Carlos Bulosan, Maxine Hong Kingston, John Okada, Hisaye Yamamoto, Amy Tan, Chang-Rae Lee, and Bharati Mukherjee. Attention will be paid to the historic, biographical, and cultural contexts of each text as well as the aesthetic and literary aspects of its style, language, and structure. Offered periodically.', 'Undergraduate', 4, 1),
('EL4030', 'EL', 'Women & Narrative', 'This course examines novels, stories, letters, journals, poems, essays, and autobiographies by such women as Dorothy Wordsworth, Emily Dickinson, Charlotte Forten, Virginia Woolf, Nella Larsen, Alice Walker, Gloria Anzaldua, and Maxine Hong Kingston. Each student will select the work of one writer for a research paper. Offered every year.', 'Undergraduate', 4, 1),
('EL4050', 'EL', 'Lesbian & Gay Literature', 'This course primarily focuses on the emergence of gay, lesbian, and transgender literature and culture from the mid-twentieth century to today. Students will read works from various genres, including novels, stories, drama, poetry, and memoirs, and will also watch documentaries. Topics covered include homophobia, coming out, the gay rights movement, lesbian feminism, AIDS, and transgender. Authors may include James Baldwin, Audre Lorde, Adrienne Rich, Essex Hemphill, Tony Kushner, Jeanette Winterson, Leslie Feinberg, and others. Offered periodically.', 'Undergraduate', 4, 1),
('EL4060', 'EL', 'Literature of Class & Class Consciousness', 'Class represents a largely unacknowledged “culture” coexisting and interacting with others such as ethnic cultures, women’s experience, and lesbian/gay culture. This course looks at fiction, poetry, and drama about class and class conflict, primarily by writers from working-class backgrounds. Examining class and class consciousness, and the interaction of class and race in the U.S., we will explore how literature has been a medium for members of oppressed groups to voice their experiences, world views, and demands, and also for members of more privileged groups to respond to social change. Offered periodically.', 'Undergraduate', 4, 1),
('EL4080', 'EL', 'Extraordinary Bodies: Disability in Literature', 'This course will examine how the depiction of bodily difference in literature leads to crucial questions about normative experience, language, and identity. The course will study the representation of extraordinary bodies in several literary genres autobiography, poetry, fiction, and drama. While some attention will be given to constructions of disability throughout literary history, the particular focus will be on more recent texts written by writers with disabilities who take up the project of identifying themselves outside of “ablist” terms. Offered periodically.', 'Undergraduate', 4, 1),
('EL4200', 'EL', 'Biblical-Classical Influences on Multicultural Literature', 'Building on common foundations, this degree offers two upper-level specializations: Multicultural U.S.-British Literature and World Literature.', 'Undergraduate', 4, 1),
('EL4300', 'EL', '20th - Century Literature: Colonialism and Postcolonialism', 'This course introduces student to the diversity of literary, philosophic, and political topics addressed by postcolonialism.', 'Undergraduate', 4, 1),
('EL4311', 'EL', 'Greek Drama', 'An introduction to the genre of Greek tragedy, taught in translation.', 'Undergraduate', 4, 1),
('EL4312', 'EL', 'Greek Mythology', 'This course surveys the most influential stories of Gods and Heroes in Greek myths, focusing on their place in ancient Greek and Roman literature, society and religion, but also tracing their course in intellectual and art history through the Renaissance to the present day.', 'Undergraduate', 4, 1),
('EL4325', 'EL', 'Shakespeare: Selected Plays', 'A study of five of Shakespeares plays via a close analysis of texts and performances.', 'Undergraduate', 4, 1),
('EL4400', 'EL', 'Critical Theory', 'Introduction to critical theory and its use for interpreting literary texts, film, and media forms in global culture.', 'Undergraduate', 4, 1),
('EL4402', 'EL', 'Sin and Sexuality in Literature', 'This course examines ways of seeing, or representation, in the making of gender and sexuality across time and place.', 'Undergraduate', 4, 1),
('EL4500', 'EL', 'Topics in British/US Literature', 'This course gives in-depth knowledge of particular periods and genres of literature; topics are offered on a rotating basis. They may include nineteenth-century British fiction; periods and genres in U.S literature; seventeenth- and eighteenth-century British literature; women writers 1760-1840, and others. Offered periodically.', 'Undergraduate', 4, 1),
('EL4510', 'EL', 'Modern Drama and Theater', 'This course will involve reading and viewing critically and analytically plays dealing with important themes and political issues from the late nineteenth century to today. Students will learn to see the theater as a social institution, a form of communication, a means of consciousness-raising, and a site for artistic innovation. Plays may include works by Henrik Ibsen, G.B. Shaw, Eugene O’Neill, Eugene Lonesco, Tennessee Williams, Arthur Miller, Lorraine Hansberry, Edward Albee, Amiri Baraka, August Wilson, David Henry Hwang, Tony Kushner and Anna Deveare Smith. Class will likely take at least one trip into Manhattan to see a live performance. Offered periodically.', 'Undergraduate', 4, 1),
('EL4520', 'EL', 'Reading and Writing the Short Story', 'This course is almost equally divided between interpretive analysis of short stories and a workshop approach to creative writing.  In the first part of the semester, we read a variety of short stories, with a view toward extracting principles of characterization, description, and voice that can help students begin to create their own stories, guided by exercises.  The second half combines readings of literature showing the historical development of the story and the tale with collaborative exercises in which students assist each other in critiquing and revising a complete short story.  Offered periodically.', 'Undergraduate', 4, 1),
('HI2681', 'HI', 'Introduction to European History', 'A systematic survey of European political, social, economic, cultural and intellectual history since the Renaissance. The course provides the student with the story of the origins, the pre-conditions, and the continuity of the “making” of the new Europe up to the present. Topics include the age of discovery, nation building, despotism, romanticism, nationalism, science and technology, ideologies and revolutions. An excellent basis for the further study of European history in upper-division courses', 'Undergraduate', 4, 1),
('HI2810', 'HI', 'Geography, Earth, and People', 'Geography sits at the interface between people and their physical world. This course explores this interface by looking at three key elements of the discipline: Mapping, Physical Geography and Socio-Cultural Geography. In the first half of the course, students learn basic concepts and methods to read and make maps and explore the forces making landforms and landscape. In the second half, students make use of these skills and concepts to explore the diversity of human interactions with the physical world. Using the concept of “region,” students are introduced to social and physical factors defining world regions as well as the connections that bind these regions together', 'Undergraduate', 4, 1),
('HI3003', 'HI', 'Environments in World History I Antiquity-1500', 'The 21st century has brought with it an ever-increasing awareness of environmental concerns and their impact upon our planet. Issues such as climate change, sustainability, food production, land use, intensive farming, pollution and resource use have become part of our global conscience and have formed the center of critical research worldwide. What can we do to alleviate these concerns? Arguably, the past is an important place to begin. An understanding of how past societies managed the land, worked with animals, dealt with varying climates and landscapes and fed their populations may have important implications for the future. This course seeks to provide students with a multi-disciplinary introduction to food, farming and energy in Western Europe from the Roman period through to the late medieval. The course will thus offer an introduction to western history and its developments through the critically important lens of the environment, using a combination of primary and secondary sources. Students will also explore the connections between the west and other parts of the world: interactions between Imperial Rome and the east, the impact of the Vikings from Byzantium to North America, agricultural developments in the Islamic world and late medieval Europeans’ interactions with both the western and non-western worlds, particularly in the era of the Black Death', 'Undergraduate', 4, 1),
('HI3005', 'HI', 'Environments in World History II1500- Present', 'This course will introduce the evolving mentalities about nature and the environment, which influenced human behavior and actions throughout history from approximately the fifteenth to the twenty-first centuries. It will look at the dual process of how both “natural” and the human-built environment influenced humans as well as how human activities affected the environment. The course explores these themes in the context of an increasingly interconnected world, but with an emphasis on Non-Western examples. The course aims to familiarize students with the fundamentals of studying history as an important basis for developing and improving writing skills, critical thinking, and research abilities', 'Undergraduate', 4, 1),
('HI3011', 'HI', 'Foundations of the Judeo-Christian Tradition', 'Western civilization is often characterized as the dynamic interplay of two cultural traditions referred to in convenient shorthand as “Athens and Jerusalem.”  This course will examine “Jerusalem”:  the text, figures, themes, and ideas that have defined the Judeo-Christian tradition. The course will emphasize the reading of the Biblical text itself beginning with Genesis and ending with selections from the Pauline tradition.', 'Undergraduate', 4, 1),
('HI3080', 'HI', 'Asian Cultures', 'An introduction to the historical and cultural traditions of India, China and Japan. This course invites students to explore the major traditions, ideas, values and social systems that shaped the lives of the peoples of these three Asian countries in the past and that continue to do so today. Students are encouraged to explore their reactions to these unfamiliar ways of life while, at the same time, gaining the ability to view each civilization and culture from its own perspective', 'Undergraduate', 4, 1),
('HI3091', 'HI', 'African Cultures', 'An exploration of African civilization, concentrating on the systems of ideas, values, and institutions developed by Sub-Saharan peoples in the context of their historical experience. The unity and diversity of African cultures are related to the economic, political, and social forces operating upon them in relation to the contemporary search for African self-determination.', 'Undergraduate', 4, 1),
('HI3110', 'HI', 'Latin American Culture', 'This history of the Latin American countries is studied from its origins through today. Topics explored include the Amerindian cultures, European conquest and colonialism, African slavery, revolution and independence, “caudillismo” and dictatorships. These topics will be studied through the use of maps, films and literature.', 'Undergraduate', 4, 1),
('HI3455', 'HI', 'Modern European Revolutions', 'A comprehensive analysis of Europe’s most dramatic revolutions that have fundamentally transformed modern life. The course will focus the French Revolution, the Revolutions of 1848, the Paris Commune, and the Russian Revolution. The ideological and socio-economic background of each revolution will be examined  in the context of Europe’s larger cultural, social, and economic development.', 'Undergraduate', 4, 1),
('HI3458', 'HI', 'Frontiers of Science and Technology in the 20th Century', 'This course analyzes the role of technology in the 20th Century. An analog world dominated the first half of the twentieth century. It gradually transformed into a digital, connected globe. How did this process of change de- velop during the Cold War? We will discuss and debate the effects of technology on the Cold War, and you will attempt to determine which technological aspect had the greatest impact on its outcome. This is a course on the history of science and technology as a social phenomenon. This course will cover various technologies, innovations and policies from the United States, the Soviet Union, and their various allies, such as China, in fields such as agriculture, space, communications, among others', 'Undergraduate', 4, 1),
('HI3558', 'HI', 'Classical Greco-Roman History', 'This course will develop an appreciation and understanding of the history of Classical Greek and Roman civilization. It will survey various aspects of society beginning with the early Minoan and Mycenaean civilization and ending with the fall of the Western Roman Empire. The course goals are for students to learn the historical and cultural framework of Greek and Roman civilizations; to understand the social, ethical and religious setting as well as the philosophical thought of the time; to comprehend geographical locations, the names of prominent people in history and their political and military contributions as these influenced both their times and today; to explore the relationship of Greco-Roman civilization to neighboring civilizations to the east and the peoples to the north; and to apply critical and creative thinking to the study of ancient leaders and extrapolate what can be learned from their life experiences', 'Undergraduate', 4, 1),
('HI3600', 'HI', 'Global Geography', 'This course develops a human geography approach to a diversity of political economic and cultural topics of global importance from an international, cross-cultural and historical perspective. It highlights the roots of con- temporary global relationships among places as they influence political and economic trends. A wide and shifting range of topics are covered including, among others, the political economy of the world system, globalization and development, geopolitics, the geography of food and agriculture and urban geography. This course also introduces students to the critical thinking skills necessary for a geographical analysis and to sharpen their global awareness.', 'Undergraduate', 4, 1),
('HI3610', 'HI', 'America’s African Heritage', 'An examination of the role of Africans in the shaping of America’s culture and society up to the present. An interdisciplinary study of the notion of cultural continuity, and of cultural carryovers as they have impacted upon language, music, art forms, religious worship, and political life', 'Undergraduate', 4, 1),
('HI3640', 'HI', 'African History', 'Approaches the history of Africa from the viewpoint of African people. Archaeological records, oral tradition and documentary sources bring ancient and medieval Africa to life. Later units will focus on important themes and debates in African history today. Students will come to understand African civilization in the context of who Africans are, the social forces that have shaped their experience, and the new directions and problems they face in the post-independence era. Offered annually', 'Undergraduate', 4, 1),
('HI3703', 'HI', 'Modern Philosophy', 'This course will examine some of the major philosophers of the modern period. Readings will be drawn from thinkers including Descartes, Hume, Kant, Hegel, Marx, Kierkegaard, Nietzsche. The course will conclude with selected topics and issues in 20th Century thought.', 'Undergraduate', 4, 1),
('HI3835', 'HI', 'Islamic Cultures', 'This course provides an introduction to the history of Muslim people and societies, and the belief system of Islam.  Beginning with the socio-economic background of pre-Islamic Arabia, we will explore the radically transforming message of the Quran and the empire founded by Muhammad as spiritual and political leader.  Students will gain insight into the spread of Islam, as it developed from a regional faith into a force in world civilization in Europe, Africa, the Middle East, and Asia.', 'Undergraduate', 4, 1),
('HI3840', 'HI', 'Crescent and Cross', 'This course provides an introduction to the roles that Islam and Christianity have played in the history and social structures of the Middle East and Europe. After presentation of the origins and essential principles of both faiths, we will explore the interactions of the faith communities across geographic and ideological boundaries, concluding with consideration of how Muslim/ Christian dialogue and conflict shape our world today', 'Undergraduate', 4, 1),
('HI4001', 'HI', 'Nineteenth Century', 'The impact of European culture and imperialism on the peoples of India and Japan. Literary works of the period are used to highlight the changes reshaping Europe in the early nineteenth century, the encounters between Europeans and Asian peoples which accompanied the expansion of Europe and the attempts of Europeans and Asians to come to terms with these encounters. Readings include Dickens’ Hard Times, stories by Rudyard Kipling and Rabindranath Tagore, Botchan by Natsume Sosek', 'Undergraduate', 4, 1),
('HI4011', 'HI', 'Twentieth Century', 'The mutual impact of cultures throughout the world; the end of nineteenth century colonialism; revolutions and wars; the emergence of the “third world.” Study of the interrelationship of European with Asian and African cultures in the twentieth century. Readings include novels from several cultures.', 'Undergraduate', 4, 1),
('HI4062', 'HI', 'Making History', 'Students will examine a variety of approaches to the study and writing of history. The course challenges the popular conceptions of history as a simple record of the past and of historians as the keepers of that record. The aim is to reveal the active role of the historian in the making of history and to show the uses of the past in the present and for the future', 'Undergraduate', 4, 1),
('HI4306', 'HI', 'Golden Age of Islam', 'This course focuses on the intellectual and cultural achievements of Islamic civilization, from Islam’s emergence to Arabia in the 7th century through the Mongol invasions in the 13th century. Topics include:  the development of Islamic law, science, arts, philosophy; the role of trade and the teachings of mysticism, and the rise of distinctive Persian and Turkish cultures in Islamic settings. The interactions of Islamic civilization with Byzantium and Europe, as well as Central Asia nomadic groups, will be discussed.', 'Undergraduate', 4, 1),
('HI4415', 'HI', 'Europe of the Dictators', 'The course focuses on the rise of the totalitarian regimes (Fascism, Stalinism and Nazism) in the context of the development of modern Europe. It begins by tracing their roots in the nineteenth century; surveys their appearance and development in the early twentieth century, and concludes with  the collapse of the Soviet bloc and the emergence of the new Europe in the 1980s and 1990s.', 'Undergraduate', 4, 1),
('HI4420', 'HI', 'Women and Witchcraft', 'While the term “witchcraft” most commonly evokes images of the Salem witch trials and the early modern European witch persecutions, witchcraft has much earlier roots, in Hebrew and other ancient Near Eastern cultures and Celtic and Germanic religion and tradition. Although the witch hunts that plagued Europe for several centuries began in the late Middle Ages, it is clear that witchcraft accusations could be leveled at women – in some cases those who were powerful and/or influential – from a much earlier date. Despite the fact that both the sorcerer and the witch could be either male or female, there was a preponderance of women accused, tried and executed for witchcraft. This course will trace the history of witchcraft in Europe from late antiquity to the early modern period, with a focus on its association with women. As this course examines the history and development of witchcraft, it will incorporate case studies on women such as Queen lfthryth, Dame Alice Kyteler, Joan of Arc and Queen Anne Boleyn', 'Undergraduate', 4, 1),
('HI4600', 'HI', 'World Regional Geography', 'This course focuses on the heightened connections between different parts of the world through a survey of the world’s major regions. The course not only provides a description of the different environmental, economic, cultural, political and social aspects of world regions, it provides an understanding of the differential effects of globalizaion as it interacts with particular local and regional settings. This course should give students a broad, yet relevant understanding of the world in which they live and how histories and events of distant regions are related to their daily lives. ', 'Undergraduate', 4, 1),
('HI4632', 'HI', 'Japanese History', 'From Samurai to Businessmen:  a survey of Japanese history and culture from before the days of the Samurai warrior to the world of the modern business corporation.  Special emphasis on aspects of Japanese culture that remain important today:  the question of Japan as a country of cultural “imitators”; the relationship between the traditional importance of groups in Japanese society and Japan’s enormous industrial success; and the significance of the Japanese emphasis on skills of art and violence—once so admired in Samurai warriors and still highly valued today. ', 'Undergraduate', 4, 1),
('HI4800', 'HI', 'History of India', 'Fat Maharajas atop bejeweled elephants, naked holy men sitting silently along the roadside, ragged children begging for scraps of food, maddened zealots attacking each other from caste hatred or religious fanaticism -these are the stark images that dominate American and Western ideas about India. But India’s 5,000-year history offers much more. From the intricacies of an ancient Sanskrit-based culture and the grandeur of Mughal tombs to the vibrancy of modern Bollywood films and the contending ethnic/religious identities of post Independence India—India’s history tells the story of how diverse populations wove together their different ways of life to create the multi-dimensional tapestry that is India today. This one semester course explores the vibrant diversity of India’s past with an emphasis on its multiple legacies and the ways 20th and 21st century Indians have used these legacies to construct modern identities and a modern, democratic nation.', 'Undergraduate', 4, 1),
('HI4850', 'HI', 'Domesticity 19th/20th centuries', '“A place for everything and everything in its place.”  This trans-regional history course explores the spread of European, middle-class ideas about home and family life-global domesticity—throughout the 19th century world, with special focus on origins in England and development in and impact on America, India and Africa. What relationship should exist between a husband and a wife, how a mother should raise her children, even how kitchen spices should be arranged on a storeroom wall—all became issues for debate and contestation. We look at these debates and conflicts through domestic manuals produced in these countries and through the life stories of people (mostly women) who wrote and/or read these materials.', 'Undergraduate', 4, 1),
('HI4900', 'HI', 'Modern China [study abroad]', 'Offered in conjunction with the faculty and staff of a university in China. Through lectures, trips, and everyday living experiences, this 4 week summer course will introduce students to all aspects of life in modern China—from its culture to its business community, from its political philosophy to the ideas of the men and women on its streets. Students will attend lectures and live at Wuyi University and work with Wuyi faculty and students. Day trips will allow students to explore cultural spots and cities in Guangdong Province and a special four day trip will take students to nearby Hong Kong and Macao', 'Undergraduate', 4, 1),
('HI4905', 'HI', 'Chinese Civilization', 'An introduction to one of the oldest civilizations of the world. This course will provide students with general knowledge of 5,000 years of Chinese history and peoples, cultures and traditions, languages and literatures, music and arts, as well as philosophies and beliefs. It will also introduce students to the impact of cultures on the establishment and development of the Chinese social, political and economic systems. ', 'Undergraduate', 4, 1),
('HI4910', 'HI', 'Chinese Diaspora Across the Pacific', 'This trans-regional course provides historical analyses in the migration of the Chinese to the United States from the early 19th century to the present. It discusses issues relating to immigration policies, race, class and ethnicity.  It also examines trans-cultural identity in global perspectives. Offered each fall', 'Undergraduate', 4, 1),
('IR2210', 'IR', 'Unions and Management: An Introduction ', 'Focusing on the current state of labor-management relations, this course introduces students to collective bargaining, labor and employment law, history of labor relations, labor union and management organizational structures, grievance handling and arbitration, and labor and management strategies. Required for all Industrial and Labor Relations majors.', 'Undergraduate', 4, 1),
('IR3120', 'IR', 'History of American Labor Relations', 'This course follows the broad contours of American labor-management history, with an emphasis on the sources of growth and decline of the modern labor movement. Factors examined include:  forms of employer and union organization, legal status of unions, immigration, race, gender, globalization, technology, politics, and ideology. Organizations surveyed include:  Knights of Labor, Industrial Workers of the World, American Federation of Labor, Congress of Industrial Organizations, and the AFL-CIO', 'Undergraduate', 4, 1),
('IR3140', 'IR', 'Unions and Public Policy ', 'This course follows the broad contours of American labor-management history, with an emphasis on the sources of growth and decline of the modern labor movement. Factors examined include:  forms of employer and union organization, legal status of unions, immigration, race, gender, globalization, technology, politics, and ideology. Organizations surveyed include:  Knights of Labor, Industrial Workers of the World, American Federation of Labor, Congress of Industrial Organizations, and the AFL-CIO', 'Undergraduate', 4, 1),
('IR3260', 'IR', 'Comparative labor Relations', 'This course will introduce students to the labor relations systems in a number of countries and provide a framework for examining labor relations systems globally. Participants will discuss the varied socioeconomic and political environments in which labor relations systems have developed and explore how they are responding to the challenge of globalization and capitalism in the 21st century. Particular emphasis will be placed on union strategies for growth and revitalization. By studying the labor relations systems of various countries, it is possible to gain a broader perspective and thus better understand labor movements more generally and the forces that continue to shape labor’s choices and strategies', 'Undergraduate', 4, 1),
('IR3300', 'IR', 'Collective Bargaining and Grievance Procedures ', 'Labor-management negotiations; the evolution of the modern labor contract, labor law analysis, grievance procedures, techniques of conciliation, mediation and arbitration.', 'Undergraduate', 4, 1),
('IR3330', 'IR', 'Women, Minorities and the Workplace', 'The program in ethnic and gender studies in the workplace ensures that as our society continues to diversify, individuals entering a variety of professional fields are well prepared and well poised to disrupt systems and structures that perpetuate institutional and interpersonal bias and hinder the struggle to achieve racial/ethnic and gender equity in the workplace. The certificate will prepare preprofessional students as leaders in issues of discrimination, diversity, equity, inclusion, and oppression.', 'Undergraduate', 4, 1),
('IR3415', 'IR', 'Labor Economics', 'Develops different frameworks for understanding today’s labor markets, ranging from market-based to institutionalist theories. Includes analysis of current trends, major factors affecting the labor supply (e.g., immigration, women workers, unions) and the demand for labor (e.g., automation, investment policies, business cycle, productivity). Offered every year', 'Undergraduate', 4, 1),
('IR3500', 'IR', 'Arbitration and Mediation', 'This course studies the function of arbitration in the field of labor-management relations, including an analysis of principles and practices, the law of arbitration, briefs, the conduct of an arbitration hearing, and the preparation of an arbitration opinion and award. Students also study the use of mediation in resolving contract grievances.', 'Undergraduate', 4, 1),
('IR3860', 'IR', 'Development of the Modern Corporation', 'The modern corporation viewed as the dominant institution of the 21st century. Major areas of study include:  historical development; multinationals and conglomerates in today’s global economy; political and economic power; private planning; labor relations.', 'Undergraduate', 4, 1);
INSERT INTO `course` (`course_ID`, `dept_ID`, `course_Name`, `course_Desc`, `Type`, `course_Credit`, `ACTIVE`) VALUES
('IR4320', 'IR', 'Labor and Employment Law ', 'This course studies the function of arbitration in the field of labor-management relations, including an analysis of principles and practices, the law of arbitration, briefs, the conduct of an arbitration hearing, and the preparation of an arbitration opinion and award. Students also study the use of mediation in resolving contract grievances.', 'Undergraduate', 4, 1),
('IR4600', 'IR', 'Topics in Labor Studies', 'Labor studies is an interdisciplinary program that examines the nature and meaning of human work. Topics include workers rights, social and economic justice, the history and role of labor unions, fair trade, human resource management, and workplace ethics', 'Undergraduate', 4, 1),
('IR4900', 'IR', 'Senior Project/Internship in Industrial and Labor Relations', 'Student completes a major research project or internship, individually tailored to her or his background and experience. Offered every semester', 'Undergraduate', 4, 1),
('MA1020', 'MA', 'College Algebra', 'Topics include functions, factoring polynomials, rational and algebraic expressions, exponents and radicals, solutions to quadratic equations, inequalities, graphs of functions, exponential and logarithmic functions, solution of exponential and logarithmic equations. Offered every semester.', 'Undergraduate', 4, 1),
('MA2000', 'MA', 'Applied Statistics', 'Applied Statistics is a Liberal Education Curriculum course intended to develop the statistical literacy of all students regardless of their major. The emphasis is on organizing and summarizing data, applying appropriate statistics, and on understanding and interpreting the results of statistical tests. Real data derived from a variety of felds including education, psychology, sociology, life and physical sciences, economics, and business will be used throughout the course.', 'Undergraduate', 4, 1),
('MA2010', 'MA', 'Foundations of Mathematics', 'A course designed primarily for students majoring in elementary education. MA 2010 covers fundamental theory, historical context and underlying logic of mathematics taught in elementary school. Content is intended to complement the recommendations in the National Council of Teachers of Mathematics Standards, and emphasis is placed on problem solving and communication in mathematics. Topics studied include introductory problem solving, functions, number systems, the operations and properties of arithmetic, estimation, and selected topics from set theory and number theory. Offered every semester.', 'Undergraduate', 4, 1),
('MA2050', 'MA', 'Quantitative Reasoning and Decision Making', 'This course was designed for Liberal Education Curriculum, and is intended to improve quantitative literacy and reasoning skills regardless of major. MA2050 provides essential skills in logic, problem solving, critical thinking and decision making. Quantitative methods and applications to real-life problems are explored, as well as decision tools for individuals and society. Topics include measurement, patterns and trends, proportion and equity, understanding data and graphs, logic and sequential reasoning, risk, uncertainty, probabilistic reasoning, natural law, descriptive statistics, decision trees. Personal decisions and applications across disciplines are explored in areas that include consumer fnance, advertising, numbers in the news, personal behavior, health and medicine, incidents and accidents, insurance, energy, environment and sustainability. Fulflls math profciency requirement', 'Undergraduate', 4, 1),
('MA2080', 'MA', 'Precalculus for Business and Economics', 'The study of linear, quadratic, exponential, and logarithmic functions and their graphs. Systems of equations and an introduction to matrices. Applications in the felds of business and economics. Offered every semester.', 'Undergraduate', 4, 1),
('MA2090', 'MA', 'Precalculus', 'A course designed primarily for students who wish to take MA2310. A study of algebraic, logarithmic, exponential, and trigonometric functions and their graphs. Offered every semester.', 'Undergraduate', 4, 1),
('MA2300', 'MA', 'Calculus for Business and Economics', 'Limits, differentiation, and integration. Relevant applications from the areas of business, economics and the social sciences. Offered every semester.', 'Undergraduate', 4, 1),
('MA2310', 'MA', 'Calculus and Analytic Geometry I ', 'Learning the concepts and applications of differential equations and integral calculus', 'Undergraduate', 4, 1),
('MA2320', 'MA', 'Calculus and Analytic Geometry II ', 'Further strengthening the base knowledge gained in calc I', 'Undergraduate', 4, 1),
('MA2500', 'MA', 'History of Mathematics', 'A survey of the history of mathematics from the beginnings through the 20th century, with special attention to culture and mathematics. Emphasis on topics germane to the high school curriculum. Offered every other semester.', 'Undergraduate', 4, 1),
('MA2701', 'MA', 'Business Anaytics', 'Business Analytics is a course of data analysis and data mining for managers. We will see number of modern techniques from a higher level viewpoint with the purpose of understanding the application toward decision-making instead of the theoretical foundations. These skills are in-demand and could help one be more competitive in the workplace. The course will cover topics in prediction, classifcation, and clustering. It also introduces datavisualization tools, as well as dimensionality reduction techniques.', 'Undergraduate', 4, 1),
('MA2702', 'MA', 'Marketing Analytics', 'Marketing Analytics is a course of data analysis and data mining for marketing purposes. We will see number of modern techniques from a higher level viewpoint with the purpose of understanding the application toward decision-making instead of the theoretical foundations. These skills are in-demand and could help one be more competitive in the workplace. The course will cover topics that could include Pricing, Forecasting, and Market Segmentation. We will use tools such as Excel Solver, Monte Carlo Simulations, Logistic Regression, Trees, Cluster Analysis, and Neural Nets.', 'Undergraduate', 4, 1),
('MA3020', 'MA', 'Foundations of Mathematics II', 'A course designed primarily for students majoring in elementary education. MA2020 covers fundamental theory, historical context and underlying logic of mathematics taught in elementary school. Content is intended to complement the recommendations in the National Council of Teachers of Mathematics Standards, and emphasis is placed on problem solving and communication in mathematics. The syllabus includes topics from elementary combinatorics, probability, statistics, geometry and measurement.', 'Undergraduate', 4, 1),
('MA3030', 'MA', 'Discrete Mathematics ', 'Introducing the study of mathematical structures that are discrete instead of continuous', 'Undergraduate', 4, 1),
('MA3160', 'MA', 'Linear Algebra ', 'Teaches linear equations and their representations in vector spaces and through matrices', 'Undergraduate', 4, 1),
('MA3180', 'MA', 'Foundations of Secondary School Mathematics', 'This course is designed for students planning to be secondary school mathematics teachers. The course covers the fundamental theory, historical context and underlying logic of mathematics taught in secondary school. It follows the National Council of Teachers of Mathematics Standards. The goal is for students to develop a deep understanding of secondary mathematics and to enable future teachers to provide their students with the highest quality instruction. This course can be used as a preparation for the New York State Teacher Certifcation Examination in Mathematics, Content Specialty Test.', 'Undergraduate', 4, 1),
('MA3210', 'MA', 'Intro To Probability & Statistics ', 'This course provides a foundation in probability and statistical inference. Topics include set operations, combi- natorics, games of chance, models for uncertainty, tree diagrams, random variables, discrete and continuous distributions, bayesian analysis, expectation, variance, sampling statistics, estimation, hypothesis testing. Emphasis on reasoning skills, model development and problem solving across disciplines Offered every semester.', 'Undergraduate', 4, 1),
('MA3330', 'MA', 'Calculus and Analytic Geometry III ', 'Studying the concept of continuous change in mathematics such as rates of change', 'Undergraduate', 4, 1),
('MA3520', 'MA', 'Transition to Advanced Mathematics ', 'Teaching math majoring students topics such as vector analysis analytic geometry and partial derivatives', 'Undergraduate', 4, 1),
('MA4100', 'MA', 'Number Theory', 'A study of the utilization of concrete examples to introduce concepts of modern algebra; prime numbers, congruences, diophantine equations, elementary combinatorial analysis. Offered as needed.', 'Undergraduate', 4, 1),
('MA4120', 'MA', 'Abstract Algebra I ', 'An introduction to basic algebraic structures. Topics will include groups, rings, integral domains, ideals and fields together with their homomorphisms. Offered every semester.', 'Undergraduate', 4, 1),
('MA4160', 'MA', 'Advanced Linear Algebra', 'This course is a rigorous, abstract treatment of linear algebra. Topics to be covered include vector spaces, linear transformations, eigenvalues and eigenvectors, diagonalization, inner product spaces, and canonical forms.', 'Undergraduate', 4, 1),
('MA4320', 'MA', 'Advanced Calculus I ', 'An analytical study of the theory underlining calculus. Topics will include the real number system, limits, continuity, uniform continuity, differentiability, sequences and series of functions, uniform convergence, Taylor series, theory of integration, elementary transcendental functions. Offered every semester', 'Undergraduate', 4, 1),
('MA4360', 'MA', 'Differential Equations ', 'Covering the different types of differential equations and how they relate to one or more functions', 'Undergraduate', 4, 1),
('ML2100', 'ML', 'Intermediate Spanish Conversation I', 'This course is designed for non-native speakers who have learned the basic structures of Spanish and for Hispanic students with some knowledge of spoken Spanish but no prior academic training in the language. Students will work on the four language skills (listening, speaking, reading and writing) in standard Spanish. Special emphasis, however, is placed on listening and speaking. Expanding vocabulary and building confidence in speaking are the main goals of this course. Offered every fall.', 'Undergraduate', 4, 1),
('ML2110', 'ML', 'Intermediate Spanish Conversation II', 'This course offers a comprehensive review of Spanish grammar and intensive work on vocabulary building. It is designed both for non-native speakers who have some competence in spoken Spanish and for Hispanic students who have had limited academic training in the language. The course is intended to develop competence in reading, writing and speaking. Offered every spring.', 'Undergraduate', 4, 1),
('ML2500', 'ML', 'Spanish Language and Culture', 'Increases oral profciency using authentic reading materials and “real life” situations', 'Undergraduate', 4, 1),
('ML3100', 'ML', 'Advanced Spanish Conversation and Composition', 'Designed for both non-native speakers who have had at least two years of Spanish study, and for Hispanic students who need to activate and expand their ability to think and express themselves in their heritage language. This course will provide intensive oral practice on different topics related to Hispanic culture as well as current events of particular interest to students. A variety of reading and writing assignments will help students amplify their vocabulary, lessen the interference of English in Spanish oral communication and strengthen their ability to express ideas both in conversation and in writing. Offered every fall', 'Undergraduate', 4, 1),
('ML3200', 'ML', 'Translation Workshop', 'This is an introductory course in the theory and practice of English/Spanish translation. A variety of prose texts, both literary and non-literary, will be selected for translation, using mostly Spanish as the target language, with some practice of Spanish to English translation. English and Spanish grammar rules are reviewed so students can develop a strong sense of proper usage. Students will work on comparative grammar, style, rhetorical structures and levels of  discourse. Emphasis will be placed on expansion of vocabulary in both languages, and on the development of a clearer understanding of the morphological and syntactical differences between the two languages. Offered every other Fall.', 'Undergraduate', 4, 1),
('ML3250', 'ML', 'Spanish Linguistics', 'This course provides an essential survey of the major areas of Spanish linguistics geared primarily towards the undergraduate Spanish Education major. Topics to be covered include advanced grammar and syntax, phonology, and lexical morphology. Course readings and fieldwork assignments are intended to provide the student with both a descriptive introduction to the field, which should enable non-natives to improve their own Spanish grammar, listening comprehension and pronunciation; and native speakers to be sensitive to learner difficulties, and to make them more effective educators of Spanish. The course is taught in Spanish with technical terminology given in both Spanish and English. Offered every other year.', 'Undergraduate', 4, 1),
('ML3260', 'ML', 'Spanish Sociolinguistics', 'In this course, students will study the key aspects of sociolinguistics and sociolinguistic analysis, including phonological and syntactic variation, regional variants, language and dialect in contact, code-switching among bilinguals, variation by age, gender, educational level and region including an exploration of Spanish in the United States with a view to language planning and language policy.  Course is taught in Spanish.', 'Undergraduate', 4, 1),
('ML3300', 'ML', 'Artistic Expressions of Spain 4', 'Summer course taught in English in Santiago de Compostela, Spain. This course is an overview of the art and culture of Spain through guided readings and visits to museums and galleries. Students will become familiar with masterpieces of Spanish painting, from El Greco to contemporary painters. Artistic styles and movements will be discussed, as well as the influence of various cultures on the arts of Spain', 'Undergraduate', 4, 1),
('ML3310', 'ML', 'Chicano/a Cultural Studies 4', 'Through interdisciplinary, cross cultural studies in the humanities this course examines current historical and theoretical writings on the lived experiences of Chicano/a in U.S. history. Themes include culture, politics, re-presentations, contestation, social reproduction, identity and difference, and domination/resistance. Taught in Spanish.', 'Undergraduate', 4, 1),
('ML3330', 'ML', 'Caribbean Studies', 'This course consists of a conceptualization of the Caribbean, including its history, regional diversity and popular imaginary, as well as representation of identities, nationalities, gender, social class, and the circumstances that affect those representations. The course integrates perspectives from various disciplines: Cultural Studies and Ethics, Economics, Politics, History, Ecology, and Sociology.', 'Undergraduate', 4, 1),
('ML3362', 'ML', 'Advanced Spanish Grammar and Composition', 'Designed for both Heritage speakers and second-language learners. The focus of this course is on the development of reading and writing skills through a thorough review of grammar and weekly exercises and compositions. Students will improve their ability to write in correct Spanish, expand their overall vocabulary and perfect and systematize their knowledge of grammar and correct usage. Offered every spring.', 'Undergraduate', 4, 1),
('ML3410', 'ML', 'Latino/a Writers in the US', 'Taught in English. This course recognizes the contributions of “Latino” writers who have produced a body of literature in English. The works represent the cultural diversity within the Latino communities in the United States, and the response by various authors to questions of acculturation to new social conditions. Offered every spring', 'Undergraduate', 4, 1),
('ML3500', 'ML', 'Critical Writing and Textual Analysis 4', 'Taught in Spanish. For the student who is interested in pursuing the study of literature in Spanish, this course develops critical reading and writing skills and introduces methods of textual analysis. Through intensive practice and class discussions, students will refine their ability to express independent ideas, organize their thoughts, develop a theme and interpret a literary text, in order to write effective essays and term papers in Spanish. Revising and rewriting will be an integral part of the course. Offered every fall', 'Undergraduate', 4, 1),
('ML3600', 'ML', 'Introduction to the Study of Hispanic Literature 4', 'Taught in Spanish. A prerequisite for all upper-level literature and culture courses, this course introduces students to the study of literary genres (poetry, drama, the narrative and the essay). Students will also become familiarized with literary schools and aesthetic movements. Works of noted Hispanic authors (plays, short stories and poems) will be read and analyzed with regard to form and content. Offered every spring', 'Undergraduate', 4, 1),
('ML3650', 'ML', 'Latin American Cinema', 'Taught in English. This course will provide students with an introduction to Latin American and Spanish films of the 20th and 21st centuries. Topics pertinent to cinema such as Cinema Novo in Brazil, “La movida” in Spain, etc., will be explored. Films chosen will present social, political and cultural issues.  Films will be previewed in their native language with English subtitles.', 'Undergraduate', 4, 1),
('ML3880', 'ML', 'Masterpieces of Hispanic Literature', 'Selections of outstanding literary works of Spain and Latin America from the picaresque novel to the present. Study includes major writers: Cervantes, Lorca, Unamuno, García Márquez, and others. Given in English. Offered periodically.', 'Undergraduate', 4, 1),
('ML4100', 'ML', 'The Spanish Golden Age 4', 'Taught in Spanish. A study of the literature of the Spanish Golden Age (ca. 1500-1660) which includes some of the major texts and best-known stories of world literature. Students will be guided through the reading and analysis of selections from Cervantes, Rojas, Tirso de Molina, Lope de Vega, Calderon, Gongora, etc. The works presented will provide a basis for the examination of the Baroque concepts of reality and illusion, dream and disenchantment. Offered periodically', 'Undergraduate', 4, 1),
('ML4325', 'ML', 'Contemporary Theatre of the Hispanic World', 'Taught in Spanish. Selected plays by a variety of Spanish-speaking dramatists will be read and examined critically and analytically. The plays will represent a broad range of styles and subject matter, and touch upon the philosophical, social and cultural issues that have preoccupied Spanish and Latin American playwrights in modern times. Works by Arrabal, Dragun, Garro, Triana, Paz, Fuentes and Vargas Llosa may be included as well as recent performance pieces by Latino playwrights. A focal point of the course will be the preparation of dramatic readings of selected scenes. Offered periodically.', 'Undergraduate', 4, 1),
('ML4350', 'ML', 'Recurrent Themes in Latin American Painting and Literature', 'Taught in Spanish.  This course explores the importance of art and literature in the construction of national, cultural and social discourses in Latin America. Representations of Latin America by European engravers of the 16th and 17th centuries will be analyzed alongside excerpts from colonial literary texts concerned with explaining the newly “discovered” lands to their European sponsors. We will look at nationalistic discourses as presented by the Mexican Muralist movement and writings by Octavio Paz. We will also examine the Hispanic Caribbean painters’ and writers’ project to develop a new artistic vocabulary, and their (dis) illusions with their countries’ social and political conditions. Offered periodically.', 'Undergraduate', 4, 1),
('ML4450', 'ML', 'Hispanic Women Writers', 'Taught in Spanish. A close reading and analysis of major works of fiction and poetry by Hispanic women. Students will be introduced to significant pre-20th century authors; however, the main focus of the course will be on contemporary texts. Selected writers from different areas, such as Emilia Pardo Bazan, Maria Luisa Bombal, Julia de Burgos, Rosario Ferre, Elena Poniatowska, Gabriela Mistral, Isabel Allende, et al., will give students a sense of the diversity and range of Hispanic women’s writing. We will examine these writers’ response to “machismo” and the limited role of women in traditional societies. Questions concerning the feminine literary tradition, such as how the female experience is represented in texts written by women, and whether there is a specifically “female” writing, will also be discussed.', 'Undergraduate', 4, 1),
('ML4500', 'ML', 'Culture and Literature of Spain from the Middle Ages to the 18th century 4', 'Taught in Spanish. A study of the culture and literature of Spain through representative works, beginning with the epic poem El Cid, Spain’s first recorded literary work, and continuing through the 18th century. Students will examine the concepts of honor, religious duty, love, conquest, and the nation as represented in the Spanish tradition. Offered periodically.', 'Undergraduate', 4, 1),
('ML4510', 'ML', 'Civilization and Culture of Spain 4', 'Taught in Spanish. This course will provide students with an introduction to the culture and civilization of Spain. After a brief overview of key events in Spanish history, emphasis will be placed more specifically on contemporary Spain. Analysis and discussion of literary works, films, music and art will help students understand and appreciate the role played by Spain in modern European history and her contributions in the arts as well as in popular culture. Themes for discussion and research may include: the image of human experience in the Spanish novel; pluralism, unity and the Spanish identity; post-modern cinema; the Civil War and the Franco era; Spain as Romantic myth and tourist heaven, etc. Offered periodically', 'Undergraduate', 4, 1),
('ML4515', 'ML', 'Recent Narrative from Spain', 'Taught in Spanish. This course provides an analytical and historical approach to narratives written in Spain during the last two decades of the 20th century. Students will be introduced to various aesthetic styles (parodic, historical and urban novels and short stories, science fiction and detective novels) which flourished during this period. Special attention will be given to the sociological background and the so-called “post-modern condition” which made those narratives possible. Authors such as Eduardo Mendoza, José Angel Mañas, Javier Cercas, Belén Gopegui, Manuel Rivas, etc., will be read throughout the semester.', 'Undergraduate', 4, 1),
('ML4520', 'ML', 'Culture and Literature of the Spanish Caribbean', 'Taught in Spanish. A study of the major literary trends of this century in the Caribbean area (Dominican Republic, Puerto Rico, and Cuba) seen in a general Latin-American sociocultural and political perspective. Representative works by Henriquez Urena, Llorens Torres, Pales Matos, Guillen, del Cabral, Bosch, Marques, Carpentier, Laguerre, Cabrera Infante, Gonzalez, Cesaire, Mir, Burgos, Rodriguez-Julia,', 'Undergraduate', 4, 1),
('ML4540', 'ML', 'Latin American Culture & Literature: From the European Conquest to Independence 4', 'Taught in Spanish. This course will examine the variety of genres produced in Latin America, from the earlier historical writings (diarios, crónicas, relaciones, poemas épicos, etc.) through the European-inspired literatures of the Baroque, Neoclassic, and Romantic periods. The social and political ideas of the Enlightenment and subsequent “progressive” (liberal) ideologies, culminating in the Latin American Wars of Independence and the modern process of “nation building,” will be studied within a literary context. Offered periodically', 'Undergraduate', 4, 1),
('ML4545', 'ML', 'Civilization & Culture of Latin America 4', 'Taught in Spanish. This course will serve as an introduction to various aspects of daily life and culture in Latin American countries from early times to the present. We will explore the question of the Latin–American identity: What is Latin America and who are the Latin Americans?  We will consider some of the significant intellectual, artistic, historical, and sociopolitical movements that have shaped Latin America since the beginning of its history. Major periods to be examined will be the pre-Columbian civilization, the “Conquista” and the colonial empire, the independence movements and the contemporary period. Students will become familiarized with major issues and institutions of Latin America as represented in contemporary Latin American essays, films, art, music, short stories, plays and novels. Offered periodically.', 'Undergraduate', 4, 1),
('ML4630', 'ML', 'Latin American Literature', 'Taught in Spanish. This course will examine the variety of genres produced in Latin America, from the earlier historical writings (diarios, crónicas, relaciones, poemas épicos, etc.) through the European-inspired literatures of the Baroque, Neoclassic, and Romantic periods. The social and political ideas of the Enlightenment and subsequent “progressive” (liberal) ideologies, culminating in the Latin American Wars of Independence and the modern process of “nation building,” will be studied within a literary context. Offered periodically', 'Undergraduate', 4, 1),
('ML4700', 'ML', 'Studies in Spanish Literature of the Nineteenth and Twentieth Centuries', 'Taught in Spanish. A study of the major literary trends prevailing in Spain from the beginning of the 19th century to late 20th century: Romanticism, Realism, Naturalism, the “Generation of ‘98”, the “Generation of ‘27”, the era known as “la postguerra” and postmodernism. Representative works of poetry and prose will serve as an illustration of the historical, social and artistic issues characteristic of each period. Offered periodically.', 'Undergraduate', 4, 1),
('ML4725', 'ML', 'The Novel and the City', 'Taught in Spanish. The course explores the basic connection between the modern period and the novel as a form, noting the parallel rise to prominence of the novel and the large urban centers. By the 19th century, the novel had become the most widely read form of literature, in Europe as well as in the Americas, and thus exercised considerable power not only to express but also to shape urban readers’ understanding of themselves, their desires, and their relation to their social world. A selection of city-centered novels by Spanish and Latin American writers of the 21519th and 20th centuries will help students understand how writers expand our awareness of urban sites and how they develop complex sets of themes and aesthetics concerns central to the urban experience. We will study crucial interpretive and narratological issues (character development, time and point of view) while also researching the development of public architecture and urban planning in the cities in question', 'Undergraduate', 4, 1),
('ML4750', 'ML', 'Fiction into Film: the Spanish and Latin American Cinema', 'Taught in Spanish. A study of classic Spanish-speaking films from Latin America and Spain and their contribution to Hispanic culture. The class will view, discuss and analyze films in the context of socio-political events and aesthetic movements, and place each work in cultural perspective. Particular attention will be paid to the ways in which literary works are translated into cinematic form, and to contrasting narrative practices in the novel and in film', 'Undergraduate', 4, 1),
('PE2220', 'PE', 'Introduction to Urban Issues ', 'An examination of various perspectives on urban areas and of important urban issues, including social problems of minority communities, housing and public services', 'Undergraduate', 4, 1),
('PE2300', 'PE', 'Introduction to Law ', 'This course is intended to familiarize students with the basic substantive, procedural, and structural components of the legal system of the United States of America. This course provides an introduction to the common law and the essential characteristics of the United States legal system: basic constitutional structures and the judicial function, the basics of legal methodology, the role of the legal profession in an adversary system and a survey of core legal principles in different areas of the law', 'Undergraduate', 4, 1),
('PE2420', 'PE', 'Principles of Microeconomics ', 'An introduction to neoclassical economic theory. Consumer and producer behaviors, price formation in the market and the role of the market in allocating resources and coordinating social production are among the topics covered', 'Undergraduate', 4, 1),
('PE2430', 'PE', 'Principles of Macroeconomics ', 'An introduction to conventional macroeconomic theory, including the determination of national income, government taxing and spending policy, money and banking, unemployment, and inflation', 'Undergraduate', 4, 1),
('PE2650', 'PE', 'Introduction to U.S. Politics ', 'This introduction to power and politics in the U.S. explores the Declaration of Independence and the Constitution; public opinion, interest groups, social movements, and voting; the institutions of Congress, the Presidency and the Supreme Court; and the making of current policies. Emphasis is placed on issues of power, democracy, and political and social change.', 'Undergraduate', 4, 1),
('PE3100', 'PE', 'International Relations ', 'Introduces principles of state-to-state relations, basic modes of resolving international disputes and the evolution of international organizations. The course emphasizes how each individual is related to global politics and encourages students to study and propose solutions to some of the most severe problems of human rights, national security and environmental survival. Offered every semester', 'Undergraduate', 4, 1),
('PE3400', 'PE', 'Global South', 'Analysis of the major political, economic and social problems of the Global South (i.e. nations of Africa, Asia, Latin America, and the Caribbean). The course traces broadly the history of colonialism and considers its impact on the post-colonial political economy of the Global South. Case studies may complement the general analysis.', 'Undergraduate', 4, 1),
('PE3410', 'PE', 'Contemporary US Political Economy', 'This course is designed to familiarize the student with the workings of the economy within a class and institutional context. Focuses on the economic history of the United States from the perspective of competition between f irms, management/worker relations and the involvement of the state in the economy.', 'Undergraduate', 4, 1),
('PE3690', 'PE', 'City & Suburb: Political Action and Change', 'A survey of city and suburban organization practices. Examines the role of the community organization in fostering local autonomy and as an agency for social, political and economic change in our cities and suburbs.', 'Undergraduate', 4, 1),
('PE3720', 'PE', 'LI: Economy, Environment & Society', 'The course consists of small group discussions, readings and case studies. This course is open to all bachelor level students at the university.', 'Undergraduate', 4, 1),
('PE3850', 'PE', 'State and Local Politics', 'The course examines government and politics at the state and local level, with particular emphasis on New York State. It discusses issues in state and local government and the impact of the competing interests of the people of New York on public policy. It also explores the historical context and contemporary state of policy initiatives on issues such as  criminal justice, welfare, health care, education, immigration, the environment and taxation.', 'Undergraduate', 4, 1),
('PE4100', 'PE', 'International Organizations', 'This course explores various approaches to international organizations and the contribution these organizations make to the creation, maintenance, and change of  world order. Current issues facing the United Nations and its specialized agencies, the Bretton Woods financial institutions, and regional organizations will be examined. While much attention is given in this course to the role of permanent, intergovernmental organizations, the course also examines the role of nongovernmental organizations, international law, treaties, and norms in international relations', 'Undergraduate', 4, 1),
('PE4290', 'PE', 'Environmental Economics', 'This course examines issues involved in sustainable development and is designed as a broad survey covering the most critical topics in environmental economics. The significant contribution that economic analysis can make in understanding the nature of problems in sustainable development and in providing possible solutions is the central focus of the course. Market failures are the cause of many of our most serious environmental problems but can be remedied with economic tools. The role that economic and political institutions play in allocating natural resources is examined. Students are exposed to a number of emerging sustainability issues including global warming and given ample opportunities to develop their own perspective.', 'Undergraduate', 4, 1),
('PE4409', 'PE', 'Urban Economics', 'This course examines the evolution of cities and metropolitan areas as centers of production and the relationship of urban economics to regional, national, and international economics. Attention is paid to the failure to meet the needs of significant numbers of people in urban areas.', 'Undergraduate', 4, 1),
('PE4440', 'PE', 'Food and Wine Economics', 'The purpose of this course is to provide students with a systematic introduction to basic economic concepts and issues as they relate to the food and wine industry. The process requires an understanding of the microeconomic and macroeconomic forces influencing the decisions of producers and consumers. Topics include supply and demand of food and wine, food and wine production function, both under perfect and imperfect competition as well as an introduction to behavioral economics. The course also addresses concepts in natural resources such as the tragedy of the commons and externalities, as well as government programs. ', 'Undergraduate', 4, 1),
('PE4470', 'PE', 'History of Economic Thought ', 'Surveys both the central tenets and the divergences among various schools of economic thought, e.g., classical, American institutionalism, Keynesianism, etc. The relationship between economic ideas and their social contexts is emphasized', 'Undergraduate', 4, 1),
('PE4580', 'PE', 'Origins of the Capitalist Economy ', 'Studies the economic and social origins of the modern world, from different intellectual perspectives. Topics include antiquity, feudalism, the emergence of capitalism, the Industrial Revolution, the French Revolution, the spread of capitalism, the development of underdevelopment in the Third World, monopoly capitalism and imperialism, the Great Depression.', 'Undergraduate', 4, 1),
('PE4590', 'PE', 'Global Economy in the 20th Century', 'This course analyzes political and economic change in selected countries of the region from the mid-twentieth century to the present. It examines the impact of foreign control over local resources, uneven capitalist development, class conflict, and the contemporary “pink tide” of new governments on poverty, inequality, and social progress.', 'Undergraduate', 4, 1),
('PE4609', 'PE', 'Public Administration', 'Examines organizational theories and their application in public policy. Focuses on how decisions made at various levels of government are implemented in local urban and non-urban areas. The course involves field work, visiting public offices and contacting interviews of role players in public administration case study projects. Offered periodically', 'Undergraduate', 4, 1),
('PE4620', 'PE', 'Political & Social Thought', 'Examines significant contributions to the development of western political thought from the Greeks to the 19th century. Explores in depth works by Plato, Machiavelli, Hobbes, Locke, Rousseau, Burke and John Stuart Mill.', 'Undergraduate', 4, 1),
('PE4655', 'PE', 'Constitutional Law and Politics', 'Introduction to the politics of selected countries in the Indian subcontinent. The course will examine the origins of the independence movements. Major emphasis will be placed on post-independence politics, social and economic change. Offered periodically', 'Undergraduate', 4, 1),
('PE4660', 'PE', 'Politics of India & South Asia', 'Introduction to the politics of selected countries in the Indian subcontinent. The course will examine the origins of the independence movements. Major emphasis will be placed on post-independence politics, social and economic change.', 'Undergraduate', 4, 1),
('PE4690', 'PE', 'Politics of Latin America & Caribbean', 'This course analyzes political and economic change in selected countries of the region from the mid-twentieth century to the present. It examines the impact of foreign control over local resources, uneven capitalist development, class conflict, and the contemporary “pink tide” of new governments on poverty, inequality, and social progress', 'Undergraduate', 4, 1),
('PH2900', 'PH', 'Black Lives Matter: Health Inequities in the U.S.', 'Medical anthropology considers the cultural, social, and political-economic aspects of the body, health, sickness, and healing in the  cross-cultural perspective. Students will learn major anthropological concepts of disease and illness, including biocultural analyses of health and disease, the social patterning of disease, cultural critiques of biomedicine, and non-Western systems of health, illness, and healing. Students will examine how anthropology is applied to medicine, nursing, and public health.', 'Undergraduate', 4, 1),
('PH3200', 'PH', 'Nutrition, Health, and The Food System', 'Medical anthropology considers the cultural, social, and political-economic aspects of the body, health, sickness, and healing in the  cross-cultural perspective. Students will learn major anthropological concepts of disease and illness, including biocultural analyses of health and disease, the social patterning of disease, cultural critiques of biomedicine, and non-Western systems of health, illness, and healing. Students will examine how anthropology is applied to medicine, nursing, and public health.', 'Undergraduate', 4, 1),
('PH3700', 'PH', 'Medical Anthropology', 'Medical anthropology considers the cultural, social, and political-economic aspects of the body, health, sickness, and healing in the  cross-cultural perspective. Students will learn major anthropological concepts of disease and illness, including biocultural analyses of health and disease, the social patterning of disease, cultural critiques of biomedicine, and non-Western systems of health, illness, and healing. Students will examine how anthropology is applied to medicine, nursing, and public health.', 'Undergraduate', 4, 1),
('PH4430', 'PH', 'Health Economics', 'Health Economics provides a broad overview of healthcare delivery and finance systems, both in the U.S. and abroad, and explores the role that economic theory plays in the national healthcare reform debate. The student will be introduced to a number of basic theoretical tools used in economics to explain the allocation of scarce resources in healthcare markets. The course will also explore a number of controversial questions involving the rationing of care, “market failures” in the current healthcare system, disparities in access to care, and the extent to which recent healthcare reform legislation addresses these issues.', 'Undergraduate', 4, 1),
('PH4450', 'PH', 'Human Sexuality', 'Medical anthropology considers the cultural, social, and political-economic aspects of the body, health, sickness, and healing in the  cross-cultural perspective. Students will learn major anthropological concepts of disease and illness, including biocultural analyses of health and disease, the social patterning of disease, cultural critiques of biomedicine, and non-Western systems of health, illness, and healing. Students will examine how anthropology is applied to medicine, nursing, and public health.', 'Undergraduate', 4, 1),
