('PH4610', 'PH', 'Womens Health', 'Medical anthropology considers the cultural, social, and political-economic aspects of the body, health, sickness, and healing in the  cross-cultural perspective. Students will learn major anthropological concepts of disease and illness, including biocultural analyses of health and disease, the social patterning of disease, cultural critiques of biomedicine, and non-Western systems of health, illness, and healing. Students will examine how anthropology is applied to medicine, nursing, and public health.', 'Undergraduate', 4, 1),
('PH4631', 'PH', 'Mental Health', 'Medical anthropology considers the cultural, social, and political-economic aspects of the body, health, sickness, and healing in the  cross-cultural perspective. Students will learn major anthropological concepts of disease and illness, including biocultural analyses of health and disease, the social patterning of disease, cultural critiques of biomedicine, and non-Western systems of health, illness, and healing. Students will examine how anthropology is applied to medicine, nursing, and public health.', 'Undergraduate', 4, 1),
('PH4650', 'PH', 'Substance Use: Social and Structural Determinants', 'Medical anthropology considers the cultural, social, and political-economic aspects of the body, health, sickness, and healing in the  cross-cultural perspective. Students will learn major anthropological concepts of disease and illness, including biocultural analyses of health and disease, the social patterning of disease, cultural critiques of biomedicine, and non-Western systems of health, illness, and healing. Students will examine how anthropology is applied to medicine, nursing, and public health.', 'Undergraduate', 4, 1),
('PH4661', 'PH', 'Health Education', 'Students will examine and gain an understanding of the theoretical frameworks informing health education strategies at the individual, social and structural levels.  Students analyze the methods and techniques employed in developing and conducting health education interventions. In addition, students will learn how to critically assess and  apply health education theories.', 'Undergraduate', 4, 1),
('PH4680', 'PH', 'Environmental Health', 'Students will examine and gain an understanding of the theoretical frameworks informing health education strategies at the individual, social and structural levels.  Students analyze the methods and techniques employed in developing and conducting health education interventions. In addition, students will learn how to critically assess and  apply health education theories.', 'Undergraduate', 4, 1),
('PH4750', 'PH', 'Aging and Social Policy', 'Introduces students to fundamental aspects of aging and health, with a primary focus on the United States. Beginning with an overview of the social-scientific study of aging, it examines theories of aging, factors influencing health in older adults including social support, living arrangements, work and retirement, and health care and caregiving. It includes an economic analysis of aging, with a focus on issues of health, poverty and inequality.', 'Undergraduate', 4, 1),
('PH4760', 'PH', 'Health Administration', 'Introduces students to fundamental aspects of aging and health, with a primary focus on the United States. Beginning with an overview of the social-scientific study of aging, it examines theories of aging, factors influencing health in older adults including social support, living arrangements, work and retirement, and health care and caregiving. It includes an economic analysis of aging, with a focus on issues of health, poverty and inequality.', 'Undergraduate', 4, 1),
('PH4770', 'PH', 'Occupational Health', 'Introduces students to fundamental aspects of aging and health, with a primary focus on the United States. Beginning with an overview of the social-scientific study of aging, it examines theories of aging, factors influencing health in older adults including social support, living arrangements, work and retirement, and health care and caregiving. It includes an economic analysis of aging, with a focus on issues of health, poverty and inequality.', 'Undergraduate', 4, 1),
('PH4790', 'PH', 'Health Policy', 'Identifies and analyzes the political forces acting in the health care sector and examines their relationship to the U.S. political scene. Debates over health policy are traced historically and related to major policy issues in U.S. history. Special attention is paid to coalition building; the possibility of reform; the development of the idea that health care is a right; and private influence on the functioning of public agencies; policy formation and government involvement in health care.', 'Undergraduate', 4, 1),
('PH4810', 'PH', 'Ethics in Public Health', 'Identifies and analyzes the political forces acting in the health care sector and examines their relationship to the U.S. political scene. Debates over health policy are traced historically and related to major policy issues in U.S. history. Special attention is paid to coalition building; the possibility of reform; the development of the idea that health care is a right; and private influence on the functioning of public agencies; policy formation and government involvement in health care.', 'Undergraduate', 4, 1),
('PH4820', 'PH', 'Health Law', 'Identifies and analyzes the political forces acting in the health care sector and examines their relationship to the U.S. political scene. Debates over health policy are traced historically and related to major policy issues in U.S. history. Special attention is paid to coalition building; the possibility of reform; the development of the idea that health care is a right; and private influence on the functioning of public agencies; policy formation and government involvement in health care.', 'Undergraduate', 4, 1),
('PH4850', 'PH', 'Global Health', 'Examines health problems, health status, public health policies and programs and the role of global politics and economics in determining the health status of people worldwide. The health systems of a number of countries are also examined. Local connections to global health are examined.', 'Undergraduate', 4, 1),
('PH4890', 'PH', 'Environmental Justice', 'Examines health problems, health status, public health policies and programs and the role of global politics and economics in determining the health status of people worldwide. The health systems of a number of countries are also examined. Local connections to global health are examined.', 'Undergraduate', 4, 1),
('PH4920', 'PH', 'Special Topics in Public Health', 'Examines health problems, health status, public health policies and programs and the role of global politics and economics in determining the health status of people worldwide. The health systems of a number of countries are also examined. Local connections to global health are examined.', 'Undergraduate', 4, 1),
('PH4930', 'PH', 'Immigrant and Refugee Health', 'Examines health problems, health status, public health policies and programs and the role of global politics and economics in determining the health status of people worldwide. The health systems of a number of countries are also examined. Local connections to global health are examined.', 'Undergraduate', 4, 1),
('PS2330', 'PS', 'Fundamentals of Economics', 'This courses teaces economics at the most basic level. Economics attempts to explain how and why we make the purchasing choices we do. Four key economic concepts—scarcity, supply and demand, costs and benefits, and incentives—can help explain many decisions that humans make.', 'Undergraduate', 4, 1),
('PS3130', 'PS', 'Accounting for Professionals', 'Financial literacy is fundamental to professional success today and accounting is the basis of financial understanding.  This course introduces the basics of an Accounting System.  Topics include: double entry, accrual accounting, cash, accounts receivable and payable, inventory management, fixed assets, financial statements preparation and analysis, earnings, debt, and cash flows.', 'Undergraduate', 4, 1),
('PS3230', 'PS', 'Professional Communications', 'Written and oral communication are cornerstones of professional activity.  This course is an introduction to the fundamentals of effective communication, oral and expository.  Topics include: different types of communication and the art of using them effectively through planning, research, clarity and goals. ', 'Undergraduate', 4, 1);
INSERT INTO `course` (`course_ID`, `dept_ID`, `course_Name`, `course_Desc`, `Type`, `course_Credit`, `ACTIVE`) VALUES
('PS3260', 'PS', 'Information Technology for Professionals', 'Information technology plays an ever-increasing role in the world today.  This course serves as an introduction to modern information technologies and their application to professional activities.  Topics include: uses of information technology in daily activities, decision-making, and organizational operations; assessment of needs and technological solutions’ potential to meet them; and developments in information technology and their implications for the future.', 'Undergraduate', 4, 1),
('PS3330', 'PS', 'Professional Supervision', 'Professionals must oversee the activities of other individuals in a wide variety of settings.  This course introduces the principles of supervision as they apply to organizational units and professional settings.  Topics include: organizational leadership, motivation, communication, conflict resolution, ethics, and control.', 'Undergraduate', 4, 1),
('PS3430', 'PS', 'Marketing for Professionals', 'Possessing skills and knowledge are not sufficient for success; a professional must also know how to promote ideas, products, organizations, and even themselves.  This course serves as an introduction to the principles of marketing, including product planning, distribution, pricing, advertising and promotion, and competition.', 'Undergraduate', 4, 1),
('PS3625', 'PS', 'Nonprofit Stewardship and Development', 'This course surveys concepts of leadership, leadership styles, techniques of motivation, and communications skills.  It examines how to build relationships, find supporters, enhance income, and raise funds, and considers the administrative, legal, and ethical issues related to ensuring the sustainability of the organization and budget.', 'Undergraduate', 4, 1),
('PS3675', 'PS', 'Introduction to Social Entrepreneurship', 'An introduction to how non-profits can serve their communities by fostering economic development and the improvement of the human condition through such tools as faith-based development and asset-based community development. Organizational, legal, and financial considerations of launching a social enterprise or for-profit subsidiary are examined, with an emphasis on the “triple bottom line” of meeting stakeholders’ needs, achieving economic viability, and attaining environmental sustainability', 'Undergraduate', 4, 1),
('PS3810', 'PS', 'Sales Essentials', 'Buying and selling is the heartbeat of modern life, so sales is a critical skill, a potential entry point into many organizations, and a potentially lucrative career in itself.  In this course, students learn the basics of sales: how to qualify a buyer, approach an individual or organization, conduct conversations, build rapport, listen well, assess how a consumer or company will decide to make a purchase, convey the key value points of the product or service, negotiate the terms of sale, and help the buyer buy (close the sale).  The class includes “hands-on” exercises like practicing sales conversations and role-playing sales situations, and introduces sales technology, training, compensation and commission structures, territory and account assignment, and the role of the sales manager.', 'Undergraduate', 4, 1),
('PS3830', 'PS', 'Sales Tools', 'Technology tools touch every step of the sales process.  This course introduces students to the value of sales support tools and sales operations to sellers, and the potential career opportunities in sales support itself.  Students learn how sales data is captured and analyzed and is used to support the sales process, from research and lead generation through the conduct of a sale to winning the sale and building the buyer relationship for the next sale.  Students are introduced to sales connected solutions such as Salesforce, Marketo, LinkedIn, Hoovers, and industry data sources', 'Undergraduate', 4, 1),
('PS4225', 'PS', 'The Law for Professionals', 'Professionals operate within the legal system, and a grasp of how it is structured and relates to organizations and individuals is crucial to successful navigation of this environment.  The course introduces students to the legal system as it pertains to organizations and individuals including the court system, contracts, agency, business structures, risk of loss, consumer protection, and individual rights.', 'Undergraduate', 4, 1),
('PS4325', 'PS', 'The Financial System', 'Financial exchanges play a central role in modern life, and the institutions that conduct these play a dominant role in the modern world.  This course introduces students to the capitalist financial system including financial assets, financial institutions and financial markets of different types.  Topics include: Stock and bond markets, interest rates, international financial markets, and currencies. The influence of these institutions on contemporary politics and society will be briefly explored.', 'Undergraduate', 4, 1),
('PS4420', 'PS', 'Entertainment and Sports Management', 'What are the skills and strategies needed to successfully manage athletes, entertainers, college teams, professional teams, bands, singers, rappers, broadcasters, arenas, and events? This course will survey the entertainment and sports industries; examine the relationship between organizational structures and individual career paths, and explore the roles knowledge, motivation, organization, communication, charisma, work ethic, luck, and timing play in becoming a successful entertainment or sports manager. ', 'Undergraduate', 4, 1),
('PS4425', 'PS', 'Entertainment and Sports Law', 'This course will address the legal issues associated with contracts, copyrights, trademarks, arbitration, mediation and collective bargaining as well as occupational health and safety in both the Entertainment and Sports industries. Case studies of contemporary issues like the downloading of music, payment of college athletes, and rules governing endorsements will be used to illuminate the legal structures and developments that dominate the Entertainment and Sports industries.  ', 'Undergraduate', 4, 1),
('PS4430', 'PS', 'Entertainment and Sports Marketing', 'Students will learn principles and strategies for marketing entertainers, concerts, athletes, teams, leagues, merchandise, special events and motion pictures. The course will develop an understanding of target markets, market research, product positioning, product pricing, point of purchase and e-commerce. It will also explore how the marketing of entertainment and sports has become a cultural phenomenon and one of the most formidable economic forces in today’s global marketplace', 'Undergraduate', 4, 1),
('PS4435', 'PS', 'Entertainment and Sports Finance', 'Students will learn how to read a balance sheet and apply that knowledge to protect assets and minimize ex- penses related to Entertainment and Sports enterprises. Financial concepts such as budgeting, allocation of assets, managing capital and debt as well as tax planning will be explored in relation to these industries. Finally, what can be done to help manage a client’s finances so they will have enough to live comfortably for the rest of their lives upon retiring from playing or performing will be discussed.', 'Undergraduate', 4, 1),
('PS4440', 'PS', 'Entertainment and Sports Media', 'From television to cable to DVDs to Netflix, pay-per-view, video games and beyond, today’s ever evolving media shapes and reshapes the entertainment and sports industries. In this course, students will learn how today’s media has impacted college and professional sports leagues, conferences and merchandise. The course will explore issues like why certain feature films are more profitable than others and the growing impact of documentary films and independent films on the film industry. The course will examine how the media’s role as information provider, persuader, and social commentator make it one of the most powerful forces of change in the worlds of both Sports and Entertainment today', 'Undergraduate', 4, 1),
('PS4630', 'PS', 'Financial Administration of Nonprofits', 'Starting with the principles of bookkeeping, this course surveys the overall management of nonprofits’ finances, including budgeting, reporting, financial planning, and controlling fiscal resources.  It covers the analysis of financial statements, structuring and evaluating programs, audit responsibility, and managerial financial controls in an evolving financial and regulatory environment. ', 'Undergraduate', 4, 1),
('PS4660', 'PS', 'Business Leadership and Ethics', 'The course explores how to lead organizations that have both paid staff and volunteers; ethical concepts and issues important to business leaders including corporate social responsibility, executive compensation, and how to integrate ethics into strategic business decisions; and how to plan for the long-term in the midst of immediate demands.', 'Undergraduate', 4, 1),
('PY2530', 'PY', 'Psychology of Prejudice & Discrimination', 'This course explores the causes and consequences of prejudice and discrimination as social and psychological processes on individuals, groups and communities. The effects of prejudice, stereotypes, and discrimination and how they contribute to structural inequalities are investigated. Emphasis will be placed on the role of intersectional social group identities on one’s understanding and experiences of prejudice and discrimination, and an examination of social action principles that address these dynamics', 'Undergraduate', 4, 1),
('PY2720', 'PY', 'Psychology of Gender', 'This course examines the psychological, biological, and sociocultural correlates of gender. Theories of gender development, construction of gender identity, sexual orientation, and intersectionality of gender with other social group identities will be explored. Emphasis will be placed on the social constructs of traditional “masculine” and “feminine” gender roles throughout the lifespan with a consideration of relationships, education and career paths', 'Undergraduate', 4, 1),
('PY3215', 'PY', 'Foundations of Child Development', 'This course focuses on child development (ages 0-12). Major theories and research evidence will be presented relating to three areas of children’s growth and development: (1) physical, including sensory-motor and brain development; (2) cognitive, including language, information processing and memory, problem solving, and metacognition; and (3) emotional and psychosocial, including self-identity, self-concept, and social functioning. Factors affecting children’s development, including socioeconomic status, racial and multicultural backgrounds, gender and other diversity will be discussed throughout the course, along with additional societal influences, such as family, peer, schools and teachers, and the media. Lectures, videos and discussions, class exercises, and assigned projects are intended to enhance understanding of healthy growth and relevant issues and threats to children’s development', 'Undergraduate', 4, 1),
('PY3230', 'PY', 'Adulthood & Aging', 'This course explores psychological development in the social context from early adulthood to old age. Personality theories and research methods as they apply to the study of aging are reviewed. Life cycle changes in family and work structure and roles are discussed. Additional topics include demographics, coping and successful aging, health, friendship and community, and death and dying. The impact of gender, culture and race and socioeconomic background are examined throughout. The course includes in-class exercises and a senior interview project', 'Undergraduate', 4, 1),
('PY3240', 'PY', 'Lifespan Development', 'This course will examine major theories and findings on human development, including stages of the lifespan that range from prenatal development through advanced old age. Each stage of the lifespan will be discussed within the context of physical, cognitive, and social/emotional development. Topics will also include research in developmental psychology, genetic foundations of development, as well as end of life issues', 'Undergraduate', 4, 1),
('PY3310', 'PY', 'Abnormal Psychology', 'Explores mental health challenges. In addition to surveying clinical-diagnostic systems, the course examines diverse experiences of mental distress as well as various explanatory models (e.g., biological, psychological, social, and cultural). Special attention is given to emerging areas of clinical research', 'Undergraduate', 4, 1),
('PY3311', 'PY', 'Theories of Personality', 'A survey of the major theories of personality and personality development, including psychoanalytic, behaviorist, cognitive, existential, and sociocultural theories', 'Undergraduate', 4, 1),
('PY3410', 'PY', 'Cognitive Psychology', 'Theoretical, conceptual and empirical issues in cognition will be examined from an information processing perspective. The course also includes a survey of neurophysiological aspects of perception, memory and cognitive processes. Offered every semester', 'Undergraduate', 4, 1),
('PY3420', 'PY', 'Learning & Motivation', 'Explores major theoretical and empirical issues in the area of learning, classical and operant conditioning, and examines the role of motivation and emotion in learning. The course also surveys physiological, psychoanalytic and social learning theories of motivation and emotion. Offered every semester.', 'Undergraduate', 4, 1),
('PY3510', 'PY', 'Social Psychology', 'This course is an introduction to the field of social psychology, which focuses on how we think and behave in social settings, and how our environment influences our behavior. Topics include attitude formation and change, social influence, persuasion, conformity and norms, group dynamics and group pressure, prosocial behavior, aggression, and prejudice and discrimination.', 'Undergraduate', 4, 1),
('PY3570', 'PY', 'Community Psychology', 'This course focuses on the application of community psychology action principles and research practices to the development and provision of resources and services necessary to well-functioning communities. Discussions cover prevention and intervention programs, empowerment, advocacy, and the impact of structural inequalities, political and social organization, and social group identity on community well-being. Special emphasis is placed on the application of concepts to social issues', 'Undergraduate', 4, 1),
('PY3610', 'PY', 'Brain & Behavior', 'The course examines how the brain’s mental processes regulate physiological changes in neurons thereby altering the expression of behaviors. Examples are drawn from both animal and human studies to establish structure-function relationships. Topics covered include: the structure and function of nerve cells, brain anatomy, psychopharmacology, and the genetics and evolution of behavior. Complex behaviors examined include: vision, audition, olfaction, gustation, somatosensation, vestibulation, sleep, learning, memory, cognition speech, and emotional/affective behaviors. Offered every semester', 'Undergraduate', 4, 1),
('PY3620', 'PY', 'Drugs and Behavior', 'This course examines the use of psychoactive medication in the treatment of psychiatric disorders. Basic principles of psychopharmacology are presented. Brain/behavior relationships in normal and abnormal functioning are reviewed with respect to neurotransmitter pathways and the medications that affect them. Medication and psychotherapy integration is emphasized. Offered every semester', 'Undergraduate', 4, 1),
('PY3710', 'PY', 'Psychology & Social Justice', 'This course will introduce the concept and theoretical basis of social justice and explore the experiences and psy- chological impacts of inequality, oppression, and privilege. Emphasis will be placed on investigating the structural dynamics behind the maintenance of oppressive institutions and systems, understanding the role of psychology in social issues, and applying social action principles to social problems and social movements. In addition to an intellectual understanding of social justice, this course will provide a framework for utilizing a social justice perspective in subsequent courses and in life actions.', 'Undergraduate', 4, 1),
('SY2222', 'SY', 'Sociology of Caring', 'This course analyzes the basic dimensions of structured social inequality, the unequal distribution of wealth, power, goods and services by class, race and gender. It studies different aspects of the impact of social inequality: for example, on environmental issues; social mobility; beliefs about the justice of inequality; social movements; crime, poverty and social policy. Offered depending on faculty availability', 'Undergraduate', 4, 1),
('SY2400', 'SY', 'Sociology Through the Arts', 'This course considers the dynamic tension that exists between artists and the many roles that the arts have had in society by examining the literary arts, visual arts, and the performing arts (in sum: painting and drawing; music, dance and theater; literature and poetry; and, photography and film/video). In the process of exploring the arts, we will consider the social factors that enable artistic expression to come to fruition as artistic genres are constructed. We will also analyze how the arts may serve as boundary-making social activity (i.e., by contesting an indicator of taste or style), or as boundary-breaking cultural endeavors (i.e., by contesting social rules and norms). Students will learn to critically assess the function of the arts at both the local, “street” level, as well as art circulating in the global marketplace. Students will also be encouraged to produce their own artistic contribution in response to the course material, thereby experiencing the connection between art and society as a distinctive component of our common humanity. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY2550', 'SY', 'Social Problems', 'Examines the historical and contemporary roots of critical social problems such as poverty, unemployment, ecological despoliation, delinquency, population growth, etc. Also of concern are the social policies directed toward these problems and an examination of their present and future consequences. Offered depending on faculty availability', 'Undergraduate', 4, 1),
('SY2600', 'SY', 'Social Deviance', 'Examines the patterns of deviant behavior in American society. Concentrates on the social construction of deviance: how various deviant labels are defined and applied (e.g. crime and mental illness) and the social consequences for those labeled. Students will also study the uses of moral, legal and medical models as fundamental ways of understanding both deviant behavior and the societal response to deviants. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY2800', 'SY', 'Race, Class, Gender and Sexuality', 'In this course students will examine the multiple and intersecting ways in which race, class, gender, and sexuality shape and are shaped by institutions, interaction, and individual experience. The course will explore the social construction of these concepts, the meanings and values attached to them, the ways in which they are embedded in sites of inequality, and on efforts to transform them. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY2999', 'SY', 'Religion, Science and Knowledge', 'This course is designed to serve two separate but interrelated purposes: descriptive and analytical. The ideas, con- cepts and skills developed in this course will form the basis for an understanding of the sociology of knowledge. In this course we will explore the relationships among science, belief systems (e.g., religion), social structure, histori- cal development and power. We will take as our subject matter the history and sociology of knowledge. Using historical trends and a variety of illustrative “case studies” we will explore the social and cultural origins, effects, and meaning of “science” as one way of our experiences in the universe as we know it. We will explore different theoretical models and ways of thinking of these issues as a way to understand what science is, how it is related 238to American (and more generally, Western) society, and what some of its effects have been. We will pay special attention to the role of power, authority and conflict. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY3160', 'SY', 'Sociology of Culture', 'This course engages students in the social science theories and research studies in diverse culture fields of contemporary and globalized society. Material and non-material aspects of cultural analysis are explored in such f ields as language, technology, arts, and media through their relationship to the culture production/consumption processes.  Debates about culture, policy, and culture change are analyzed in the course, and include the new research on visual culture and civic culture. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY3280', 'SY', 'Social Inequality', 'This course analyzes the basic dimensions of structured social inequality, the unequal distribution of wealth, power, goods and services by class, race and gender. It studies different aspects of the impact of social inequality: for example, on environmental issues; social mobility; beliefs about the justice of inequality; social movements; crime, poverty and social policy. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY3630', 'SY', 'Political Sociology', 'Examines the social structures and processes related to participation in the political life of society. Explores the problems the political order poses for different social classes and how institutions of power and authority are maintained in efforts to foster control and legitimacy. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY3700', 'SY', 'Family and Society', 'Through historical and comparative analysis, studies the connection between courtship and marriage patterns and different economic systems. Students examine the emergence of the modern family system, changing patterns of mate selection and courtship and the relationship between general assumptions about sex roles and role allocation in marriage itself. Comparisons are drawn across cultures and across class, race and ethnic groups in American society. Offered depending on faculty availability', 'Undergraduate', 4, 1),
('SY3750', 'SY', 'Medical Sociology', 'Explores the social forces defining and influencing health and illness. The organization and distribution of medical science and professionals are analyzed from a sociological perspective, with an emphasis on care for the poor, minorities, women, the disabled, and the aged. Alternatives to the present system of medical care in the U.S. are discussed, particularly in the context of health policy and medical care in other countries. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY3800', 'SY', 'Race and Ethnicity', 'Emphasizes the history, social structure and culture of racial national, ethnic and religious minorities. Includes such minority majority processes as interracial and intercultural conflict, domination and adaptation, accommodation and assimilation. Causes and consequences of prejudice, racism and discrimination and some ways of reducing intergroup tensions are included as are alternative models for pluralistic societies such as “melting pots” or “mosaics.” Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY3900', 'SY', 'Social Movements', 'Provides an overview of the contemporary sociological models used to analyze the dynamics of protest among disenfranchised constituencies in the U.S. Cases are drawn largely from the history of African American protest movements of the 19th and 20th century in which activists have attempted to reconcile tensions between demand for civil rights and the more radical vision of nationhood. Government and counter-movement responses to protest are also examined. Offered depending on faculty availability', 'Undergraduate', 4, 1),
('SY3910', 'SY', 'Sociology of Work', 'This course will introduce students to the sociology of work and industry. We will cover the history of work organization from ancient to modern times, but with particular emphasis on contemporary, ‘post-industrial’ capitalism. Topics to be discussed include industrial organization, bureaucracy, gender, race and ethnicity in the workplace, work and family balance, the development of the trade union movement and collective bargaining. All of these more specific areas of inquiry will be framed against the backdrop of an evolving world economy and the role of the U.S. and U.S. workers in it. The goal of the course is to provide students with a broad understanding of both the history and the myriad theoretical approaches to work, as well as research strategies for their empirical investigation. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY4260', 'SY', 'Social Work: Theory and Practice', 'Examines social work practice as a planned change process occurring within systems, i.e., one-to-one relationships, families, community groups. Provides a general overview of social work practice within the context of social welfare. Particular attention is paid to the structure and function of social welfare as an institution and to the development of concepts and techniques applicable to a wide variety of social work settings and situations. Addresses such issues as the types of opportunities in the field, necessary skills and the underlying value system', 'Undergraduate', 4, 1),
('SY4270', 'SY', 'Internship in Social Work, Sociology and Criminology', 'The internship program is designed for students who wish to develop practical skills and gain work experience in the fields of Social Work, Sociology and Criminology, integrating theory with professional experience. The students will have an opportunity to explore the professional world and to acquire training in their chosen area of specialization. The student in conjunction with the instructor will select a field internship  and perform 90 hours of f ield work. Students meet regularly to discuss their experiences and progress. They will compile a portfolio of the work done on the internship and write a detailed report describing the agency and summarizing their work. The student will use psychological, sociological and criminological theories and research to explain complex social processes experienced during the field', 'Undergraduate', 4, 1),
('SY4400', 'SY', 'Social Psychology', 'Introduces the social psychological theories of sociologists and anthropologists to show how culture and society shape and influence behavior. Focus is on theories of socialization, such as symbolic interaction, behaviorism, small group theories, perception, social exchange, etc. Consideration is given to cross-cultural examples', 'Undergraduate', 4, 1),
('SY4500', 'SY', 'Global Sociology', 'The major aims of the course are to broaden student knowledge and perspectives of diverse cultures and the global society by using historical, anthropological, and sociological theories and methods. The course will review such social processes as socio-cultural evolution, development and revolution. We will do comparative analyses, and debate global issues and policies. The global issues include the environment, population, resources, and technology; global stratification, human rights, and peace and war in contemporary society.', 'Undergraduate', 4, 1),
('SY4520', 'SY', 'Research Methods I', 'Introduces students to the concepts and principles of sociological research, including how to: interpret and construct academic research articles, conduct an analytic literature review, design and test research hypotheses, use appropriate sampling methods and apply ethical principles. Students will gain experience in qualitative data collection methods and analysis (e.g., intensive interviews, content analysis, ethnography, group interviews, question construction, historical/comparative studies) for sociology and criminology topics, and develop a research plan. Offered every semester.', 'Undergraduate', 4, 1),
('SY4530', 'SY', 'Sociological Theory I', 'Introduces the central concepts and theoretical frameworks of the founding figures of classical sociological theory: Marx, Durkheim, and Weber. By reading primary work by each theorist as well as secondary sources, students will learn the content of the theories, the theorists’ underlying assumptions, and the empirical bases of their analyses of society', 'Undergraduate', 4, 1),
('SY4540', 'SY', 'Sociological Theory II', 'Introduces modern developments in sociological theory. Students will read both primary and secondary contemporary theoretical writings, studying how modern theory builds on and diverges from classical theories. Major f ields of contemporary theory that may be covered include: functionalism, conflict theory, neo-Marxist theories, psychoanalytic theory, feminist theory and critical race theory. The emphasis is on understanding how each theorist approaches his/her own realm of inquiry as well as the actual idea systems created', 'Undergraduate', 4, 1),
('SY4570', 'SY', 'Research Methods II', 'Trains students to collect and analyze quantitative sociological data. Topics include appropriate sampling methods, survey research, probability, tests of significance and descriptive and inferential statistics. Students are introduced to statistical logic and concepts and conduct bivariate and multivariate analyses using examples from sociology and criminology', 'Undergraduate', 4, 1),
('SY4600', 'SY', 'Social Programs, Planning and Policy', 'Analyzes formation of social policy, its effectiveness as applied to specific social institutions and programs, as well as the impact of these programs on their targeted population. Broader issues of social policy within the context of political economic systems and ideologies, as well as the general structure of the American “Welfare State,” will be discussed, using cross-cultural comparisons', 'Undergraduate', 4, 1),
('SY4651', 'SY', 'Sociology of Communications and Media', 'Students will study the social science perspective in the large field of communications media, including the theories and applied research on the social, political, and economic contexts of media. Learning objectives also include looking critically at media production, producers, products, and social effects in a dynamic relationship called mediatization. The multi-mediated environment poses a number of debates about the representation of age, class, gender, race/ethnicity, and other status categories.  Students study contemporary research methods such as content analysis, which supports the “media literacy” movement in global society', 'Undergraduate', 4, 1),
('SY4810', 'SY', 'Law and Justice', 'This course focuses on the sociological understanding of how ideas of law and justice relate to issues of power, consensus, conflict and change in society. It examines the use of law as a tool in responding to different cultural groups in American society and examines the process and significance of judicial law-making under the U.S. Constitution, illustrated by case examples regarding first amendment guarantees of religious freedom and political dissent, and civil rights issues of race, nationality, gender, sexuality and disability. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY4830', 'SY', 'Gender and Society', 'Sociologists view gender as a socially constructed phenomenon – a characteristic of individuals, interactions, and institutions that is shaped by social context.  This course examines the ways in which gender is constructed and maintained, and the ways in which these processes uphold social inequalities.  Attention will be paid to the ways in which these processes are shaped by social dimensions such as race, ethnicity, social class, and sexuality as well as efforts to mitigate inequalities and to challenge normative gender constructs. Offered depending on faculty availability.', 'Undergraduate', 4, 1),
('SY4850', 'SY', 'Urban and Suburban Sociology', 'Introduces a variety of sociological perspectives on urbanization and community formation. The history of urban development is traced in terms of major social changes contributing to and resulting from the rise of cities. The expansion of cities into metropolitan regions is examined in relation to social processes in urban areas. Select problems that have arisen out of the American urban experience are considered together with such efforts to ameliorate them as urban renewal efforts and city and regional planning. Offered depending on faculty availability', 'Undergraduate', 4, 1),
('SY4950', 'SY', 'Sociology of Music', 'The Sociology of Music is a specialized field within Sociology, exploring the social aspects of music. Music surrounds us in society, enhancing our entertainment and serving as the soundtrack of our lives. However, music varies widely across the time and space of human experience. This class investigates global music cultures, and satisfies the cross-cultural component for Sociology majors. We will explore the social production of music and the roles of composers, musicians, and listeners from the classical era to the contemporary age. Emphasis will be placed on how social actors endow music with meaning, and how people use music to construct identities. Music’s relationship to social control will also be investigated. Readings assigned for the course are often highly theoretical. A final research paper is required. Offered depending on faculty availability', 'Undergraduate', 4, 1),
('SY4999', 'SY', 'Issues in Sociology', 'Gives students the opportunity to examine in greater depth the analysis and discussion of current specialized sociological work in the particular area defined by the instructor (as indicated in the schedule of classes). Students are permitted to take SY4999 Issues in Sociology for credit up to two times in which two distinct topics are covered. Offered depending on faculty availability', 'Undergraduate', 4, 1),
('VA2000', 'VA', 'Introduction to Art', 'Studio course designed to introduce frst-year students to exercises that challenge their assumptions of the creative process. This course will begin to provide students with the basic visual and verbal vocabulary to proceed to the next level in the Visual Arts curriculum. The exercises will be completed using both, the fundamentals of basic art techniques such as drawing, painting, modeling and fabricating, and references from contemporary art currents', 'Undergraduate', 4, 1),
('VA2010', 'VA', 'Introduction to Creative Thinking', 'A must for students considering careers in advertising, publishing, communications or any other discipline regarding creative visual solutions. Students solve exercises designed to challenge the way we perceive reality through conditioning and stereotypes. A variety of skills are developed at the beginners level. The objective is to develop in the students the skills to make creative visual statements avoiding conventional thinking. Required for Art majors.', 'Undergraduate', 4, 1),
('VA2020', 'VA', 'Basic Design ', 'This studio course deals with the fundamental development of visual structures and the relationship among two, three, and four (time) dimensions. Through structured projects, beginning with point and visual rhythm, the course will explore line, plane, and color. Students will learn the fundamental principals to organizing these multi-dimensions as they relate to graphics, interior design, photography, etc. and how to make informed intelligent visual decisions. The relationship between the traditional crafts such as painting, sculpture and the new electronic media arts will be discussed and studied. Required for all art majors. Offered every semester. Satisfies Liberal Education Curriculum requirement', 'Undergraduate', 4, 1),
('VA2030', 'VA', 'Drawing ', 'The process of art from idea to final product. The emphasis is on visual notations, especially drawings. Deals with planning and studying feasibilities before actually entering production, allowing students to work through an idea. Required for all art majors. Offered every semester. Satisfies Liberal Education Curriculum requirement.', 'Undergraduate', 4, 1),
('VA2045', 'VA', 'Introduction to Color ', 'This class is for those who were always afraid of color and mystified on how color combinations work. The course will be a studio class using paint and paper working through a series of projects exploring:  color theory and terminology, how it is applied to practical situations; the difference between subtractive systems as seen in the chemical world of paint and the additive system as demonstrated in electronic media and the calibration of computer monitors and color systems such as RGB, CYMK, etc. How harmonic-complementary and discordant uses of color are used in nature; after images and optical mixes of color; camouflage and how it works in nature and design; color in relation to 3-dimentional form and more will be addressed. Satisfies Liberal Education Curriculum requirement.', 'Undergraduate', 4, 1),
('VA2320', 'VA', 'Graphic Design I ', 'This course introduces the elements and principles of graphic design as building blocks that lead to effective visual communication. A series of projects focus on developing problem solving skills as well as knowledge of the software involved in creating successful design projects. Several influential design movements are covered in relation to specific principles of design. Emphasis is placed on taking initial ideas through to fully realized projects that communicate effectively. Areas covered include typography, page layout, book design, packaging and logo design, poster design and design for the web. Projects will be created in Adobe software: InDesign, Photoshop, Illustrator and Dreamweaver. Offered every semester. Satisfies Liberal Education Curriculum requirement', 'Undergraduate', 4, 1),
('VA2400', 'VA', 'Introduction to Photography', 'Beginning course for art-majors and non-art majors in photography. Emphasis is on photography as a system of visual and cultural representation. The history of photography and technical data are interspersed with shooting assignments and critique. Students supply their own materials and should own a medium-quality digital camera. Offered every semester.', 'Undergraduate', 4, 1),
('VA2500', 'VA', 'History II: Modern Art:1900-1945 ', 'This second part of the survey begins with the art of the twentieth century. It examines the many challenges to the definition and role of art that emerge from the major movements of the century such as Cubism, Surrealism, Dada, and Abstract Expressionism. The course traces the impact of photography, mass production, and politics on the role of art in early 20th century society. It also examines the split that occurs between artists who wish to make politically engaged art and artists who wish to make art for art’s sake. Offered once every year. Satisfies Liberal Education Curriculum requirement.', 'Undergraduate', 4, 1),
('VA2510', 'VA', 'Art History II: Modern Art: 1900-1945', 'This second part of the survey begins with the art of the twentieth century. It examines the many challenges to the defnition and role of art that emerge from the major movements of the century such as Cubism, Surrealism, Dada, and Abstract Expressionism. The course traces the impact of photography, mass production, and politics on the role of art in early 20th century society. It also examines the split that occurs between artists who wish to make politically engaged art and artists who wish to make art for art’s sake.', 'Undergraduate', 4, 1),
('VA2520', 'VA', 'History of Photography', 'This course introduces the history of photography from its inception in the 1830’s to recent practices of photographers and artists working with digital technologies. The primary goals of the course are to develop visual literacy, acquire familiarity with complex and contradictory genres, and understand the social functions of photographic image production. This course will look at signifcant examples of photography in art, science, war, and other felds and discuss the concepts that relate to this work.', 'Undergraduate', 4, 1),
('VA3100', 'VA', 'Visual Culture – Warhol to Present ', 'This course examines the role of art in a contemporary society inundated with visual imagery. We will situate the major art movements of the 1960s and 70s (Pop, Minimalism, Conceptual Art, Performance and  Post Modernism) within the socio- historical context of the Civil Rights Movement, the Vietnam War and the development of contemporary technologies. The course considers how contemporary art comments upon such diverse issues of race, gender and sexuality. We will also look at how the critic, the gallery, and the museum help to determine how art is defined. Required for all Art majors. Offered once every year. Satisfies Liberal Education Curriculum requirement', 'Undergraduate', 4, 1),
('VA3200', 'VA', 'Art Tutorials I ', 'Art majors must meet in tutorial sessions with the instructor to discuss ongoing work in any media. Criticism is geared to development of self confidence in the creative process and to implement technical and productive solutions. All students are required to meet with collective faculty for criticism. Required for all Art majors. (Teacher Education majors who have selected the Visual Arts concentration will learn to analyze the creative process as it relates to the classroom; how to conceptualize, and plan projects that explore creativity.)  Offered every semester.', 'Undergraduate', 4, 1),
('VA3340', 'VA', 'Introduction to African Arts', 'An introduction to the traditional and contemporary arts of the African continent. We will explore the relationship of the visual arts and the complex historical, cultural and religious context of traditional African societies. Parts of the course will be devoted to contemporary arts in post-colonial Africa, transnational developments, the 244 internationalization of African arts and aspects of Diaspora arts.', 'Undergraduate', 4, 1),
('VA3350', 'VA', 'Topics in Contemporary Art: New Media', 'This course examines recent trends and developments in the feld of new media. It discusses the relation of contemporary art to other cultural, political and technological developments.', 'Undergraduate', 4, 1),
('VA3360', 'VA', 'Topics in Contemporary Art: Art Since 1980 ', 'This course examines recent trends and developments in contemporary art since 1980 and discusses it in relation to the cultural and socio-political context. Topics include: identity, body politics, socially engaged art.', 'Undergraduate', 4, 1),
('VA3380', 'VA', 'Digital Video ', 'Students will obtain a strong foundation in digital video on the Macintosh computer through instruction in preproduction and production fundamentals. Video editing will be done with Adobe Premiere software. Students will have their own computer workstations and access to cameras, recorders, color scanners and printers. This course will provide students with the knowledge of the aesthetic, critical and analytical processes required to create effective digital videos. Offered every semester', 'Undergraduate', 4, 1),
('VA3400', 'VA', 'Digital Imaging ', 'This course covers the capabilities of both pixel-based and vector-based digital imaging software. Using Photoshop, students create a  range of projects that explore the creative potential within these programs while developing the skills necessary to execute original concepts. This course serves as a digital foundation upon which more advanced digital work in both 2D and 3D design can be built. It is a must for anyone considering a career in communications, publishing, advertising and the visual arts. Offered every semester. Satisfies Liberal Education Curriculum requirement. ', 'Undergraduate', 4, 1),
('VA3456', 'VA', 'Creative Coding: Art & Games', 'Creative Coding: Art and Games focuses on the development of a contemporary art practice incorporating interactivity and technological developments from the ground up for the creation of Art and Art-based games. What types of artworks can be conceptualized and produced when incorporating computing power? Students will learn the basics for working within the realm of physical computing; computer interfaces that go beyond the typical keyboard and mouse. The course will begin instruction with small-scale programmable computers called microcontrollers and students will become familiar with building electronic circuits in service of creative output. This course will also explore generative visual output through the fundamental steps and concepts of programming including variables, conditionals, iteration, and functions. Particular attention will be focused on creation of interactivity, whether this includes controlling and programming digital games or physical and digital artwork. This course will utilize weekly exercises to build dedicated technical skills, discussions and readings to foster critical understandings of the interactive media possibilities, and midterm and final projects to explore personal interests with conceptual rigor and creative freedom.', 'Undergraduate', 4, 1),
('VA4200', 'VA', 'Art Tutorials II ', 'This course is the second level of the Tutorial Sequence. Required for all Art majors. (Teacher Education majors who have selected the Visual Arts concentration will focus on how to teach the creative process.) This is the second level of the tutorials sequence that focuses on the processing of students’ own projects. Materials, techniques, and theory of criticism will be covered. Offered every semester.', 'Undergraduate', 4, 1),
('VA4260', 'VA', 'Interactive Web Design ', 'This course emphasizes design elements and principles as well as technical methods for creating interactive projects for the web. Working on their own original projects, students will gain a comprehensive understanding of hypertext mark-up language, cascading style sheets, interface design, and graphics protocol. Basic javascript to create interactivity, eBooks, and a game design wherein students create their own artwork, is also covered. Students use Dreamweaver, Photoshop, Javascript, text editors, Flash, ePub, and a game design content management system to create projects. Offered every semester.', 'Undergraduate', 4, 1),
('VA4265', 'VA', '3D Digital Design ', 'This course will cover 3D modeling and an introduction to 3D animation. Polygon and Surface modeling, as well as sculpting and rigging, will be taught as tools for expressing students’ own ideas for creating 3D environment, character and object designs. From these projects, students will be introduced to the methods of animating and 3D printing of their models. Offered every semester ', 'Undergraduate', 4, 1),
('VA4320', 'VA', 'Graphic Design II ', 'This course builds upon the elements and principles of graphic design outlined in Graphic Design I. Students will develop concepts that lead to effective design solutions across media platforms including: print design, packaging and logo design, web, eBook and environmental design. Students will use a variety of Adobe software: InDesign, Photoshop, Illustrator, Dreamweaver, Flash and ePub. Offered every semester. ', 'Undergraduate', 4, 1),
('VA4360', 'VA', 'Advanced Electronic and Animation ', 'This course is designed for students to further develop projects at an advanced level in the Electronic Media areas of animation, 3D design, and 3D printing and animation. Previous experience in the area of 3D design is required. Offered every semester. ', 'Undergraduate', 4, 1),
('VA4460', 'VA', 'Digital Animation ', 'This course teaches the principles of storyboarding, digital imaging, stop-motion animation, cel animation, key frame animation and sound. Utilizing Adobe software, students will conceptualize, design, draw and compose digital animations. Offered every semester.', 'Undergraduate', 4, 1),
('VA4470', 'VA', 'Art Tutorials III ', 'This course is the third level of the Tutorial Sequence. Required of all Art majors. (Teacher Education majors who have selected the Visual Arts concentration will focus on research skills, delving into the value of the creative process in art, as it applies to problem solving, and the relationship of the creative process in art as it relates to other fields and disciplines.)  Offered every semester', 'Undergraduate', 4, 1);
